INSERT INTO `movie` (`movie_id`, `Rank`, `Title`, `Genre`, `Description`) VALUES
(1, 1, 'XXX', 'adventure', 'A group of intergalactic criminals are forced to work together to stop a fanatical warrior from taking control of the universe.'),
