(9, 9, 'The Lost City of Z', 'Action,Adventure,Biography', 'A true-life drama, centering on British explorer Col. Percival Fawcett, who disappeared while searching for a mysterious city in the Amazon in the 1920s.'),
(10, 10, 'Passengers', 'Adventure,Drama,Romance', 'A spacecraft traveling to a distant colony planet and transporting thousands of people has a malfunction in its sleep chambers. As a result, two passengers are awakened 90 years early.'),
