(12, 12, 'Hidden Figures', 'Biography,Drama,History', 'The story of a team of female African-American mathematicians who served a vital role in NASA during the early years of the U.S. space program.'),
(13, 13, 'Rogue One', 'Action,Adventure,Sci-Fi', 'The Rebel Alliance makes a risky move to steal the plans for the Death Star, setting up the epic saga to follow.'),
(14, 14, 'Moana', 'Animation,Adventure,Comedy', 'In Ancient Polynesia, when a terrible curse incurred by the Demigod Maui reaches an impetuous Chieftain\'s daughter\'s island, she answers the Ocean\'s call to seek out the Demigod to set things right.'),
(15, 15, 'Colossal', 'Action,Comedy,Drama', 'Gloria is an out-of-work party girl forced to leave her life in New York City, and move back home. When reports surface that a giant creature is destroying Seoul, she gradually comes to the realization that she is somehow connected to this phenomenon.'),
(16, 16, 'The Secret Life of Pets', 'Animation,Adventure,Comedy', 'The quiet life of a terrier named Max is upended when his owner takes in Duke, a stray whom Max instantly dislikes.'),
(17, 17, 'Hacksaw Ridge', 'Biography,Drama,History', 'WWII American Army Medic Desmond T. Doss, who served during the Battle of Okinawa, refuses to kill people, and becomes the first man in American history to receive the Medal of Honor without firing a shot.'),
(18, 18, 'Jason Bourne', 'Action,Thriller', 'The CIA\'s most dangerous former operative is drawn out of hiding to uncover more explosive truths about his past.'),
(19, 19, 'Lion', 'Biography,Drama', 'A five-year-old Indian boy gets lost on the streets of Calcutta, thousands of kilometers from home. He survives many challenges before being adopted by a couple in Australia. 25 years later, he sets out to find his lost family.'),
