(25, 25, 'Independence Day: Resurgence', 'Action,Adventure,Sci-Fi', 'Two decades after the first Independence Day invasion, Earth is faced with a new extra-Solar threat. But will mankind\'s new space defenses be enough?'),
(26, 26, 'Paris pieds nus', 'Comedy', 'Fiona visits Paris for the first time to assist her myopic Aunt Martha. Catastrophes ensue, mainly involving Dom, a homeless man who has yet to have an emotion or thought he was afraid of expressing.'),
