(28, 28, 'Dead Awake', 'Horror,Thriller', 'A young woman must save herself and her friends from an ancient evil that stalks its victims through the real-life phenomenon of sleep paralysis.'),
(29, 29, 'Bad Moms', 'Comedy', 'When three overworked and under-appreciated moms are pushed beyond their limits, they ditch their conventional responsibilities for a jolt of long overdue freedom, fun, and comedic self-indulgence.'),
