(34, 34, 'Deadpool', 'Action,Adventure,Comedy', 'A fast-talking mercenary with a morbid sense of humor is subjected to a rogue experiment that leaves him with accelerated healing powers and a quest for revenge.'),
(35, 35, 'Resident Evil: The Final Chapter', 'Action,Horror,Sci-Fi', 'Alice returns to where the nightmare began: The Hive in Raccoon City, where the Umbrella Corporation is gathering its forces for a final strike against the only remaining survivors of the apocalypse.'),
