(50, 50, 'The Last Face', 'Drama', 'A director (Charlize Theron) of an international aid agency in Africa meets a relief aid doctor (Javier Bardem) amidst a political/social revolution, and together face tough choices ... See full summary ?'),
(51, 51, 'Star Wars: Episode VII - The Force Awakens', 'Action,Adventure,Fantasy', 'Three decades after the defeat of the Galactic Empire, a new threat arises. The First Order attempts to rule the galaxy and only a ragtag group of heroes can stop them, along with the help of the Resistance.'),
