(53, 53, 'Mother\'s Day', 'Comedy,Drama', 'Three generations come together in the week leading up to Mother\'s Day.'),
(54, 54, 'John Wick', 'Action,Crime,Thriller', 'An ex-hitman comes out of retirement to track down the gangsters that took everything from him.'),
(55, 55, 'The Dark Knight', 'Action,Crime,Drama', 'When the menace known as the Joker wreaks havoc and chaos on the people of Gotham, the Dark Knight must come to terms with one of the greatest psychological tests of his ability to fight injustice.'),
