(198, 198, 'Into the Wild', 'Adventure,Biography,Drama', 'After graduating from Emory University, top student and athlete Christopher McCandless abandons his possessions, gives his entire $24,000 savings account to charity and hitchhikes to Alaska to live in the wilderness. Along the way, Christopher encounters a series of characters that shape his life.'),
(199, 199, 'The Imitation Game', 'Biography,Drama,Thriller', 'During World War II, mathematician Alan Turing tries to crack the enigma code with help from fellow mathematicians.'),
(200, 200, 'Central Intelligence', 'Action,Comedy,Crime', 'After he reconnects with an awkward pal from high school through Facebook, a mild-mannered accountant is lured into the world of international espionage.'),
(201, 201, 'Edge of Tomorrow', 'Action,Adventure,Sci-Fi', 'A soldier fighting aliens gets to relive the same day over and over again, the day restarting every time he dies.'),
(202, 202, 'A Cure for Wellness', 'Drama,Fantasy,Horror', 'An ambitious young executive is sent to retrieve his company\'s CEO from an idyllic but mysterious \"wellness center\" at a remote location in the Swiss Alps, but soon suspects that the spa\'s treatments are not what they seem.'),
(203, 203, 'Snowden', 'Biography,Drama,Thriller', 'The NSA\'s illegal surveillance techniques are leaked to the public by one of the agency\'s employees, Edward Snowden, in the form of thousands of classified documents distributed to the press.'),
(204, 204, 'Iron Man', 'Action,Adventure,Sci-Fi', 'After being held captive in an Afghan cave, billionaire engineer Tony Stark creates a unique weaponized suit of armor to fight evil.'),
(205, 205, 'Allegiant', 'Action,Adventure,Mystery', 'After the earth-shattering revelations of Insurgent, Tris must escape with Four beyond the wall that encircles Chicago, to finally discover the shocking truth of the world around them.'),
(206, 206, 'X: First Class', 'Action,Adventure,Sci-Fi', 'In 1962, the United States government enlists the help of Mutants with superhuman abilities to stop a malicious dictator who is determined to start World War III.'),
(207, 207, 'Raw (II)', 'Drama,Horror', 'When a young vegetarian undergoes a carnivorous hazing ritual at vet school, an unbidden taste for meat begins to grow in her.'),
(208, 208, 'Paterson', 'Comedy,Drama,Romance', 'A quiet observation of the triumphs and defeats of daily life, along with the poetry evident in its smallest details.'),
(209, 209, 'Bridesmaids', 'Comedy,Romance', 'Competition between the maid of honor and a bridesmaid, over who is the bride\'s best friend, threatens to upend the life of an out-of-work pastry chef.'),
(210, 210, 'The Girl with All the Gifts', 'Drama,Horror,Thriller', 'A scientist and a teacher living in a dystopian future embark on a journey of survival with a special young girl named Melanie.'),
(211, 211, 'San Andreas', 'Action,Adventure,Drama', 'In the aftermath of a massive earthquake in California, a rescue-chopper pilot makes a dangerous journey with his ex-wife across the state in order to rescue his daughter.'),
(212, 212, 'Spring Breakers', 'Drama', 'Four college girls hold up a restaurant in order to fund their spring break vacation. While partying, drinking, and taking drugs, they are arrested, only to be bailed out by a drug and arms dealer.'),
(213, 213, 'Transformers', 'Action,Adventure,Sci-Fi', 'An ancient struggle between two Cybertronian races, the heroic Autobots and the evil Decepticons, comes to Earth, with a clue to the ultimate power held by a teenager.'),
(214, 214, 'Old Boy', 'Action,Drama,Mystery', 'Obsessed with vengeance, a man sets out to find out why he was kidnapped and locked into solitary confinement for twenty years without reason.'),
(215, 215, 'Thor: The Dark World', 'Action,Adventure,Fantasy', 'When Dr. Jane Foster gets cursed with a powerful entity known as the Aether, Thor is heralded of the cosmic event known as the Convergence and the genocidal Dark Elves.'),
(216, 216, 'Gods of Egypt', 'Action,Adventure,Fantasy', 'Mortal hero Bek teams with the god Horus in an alliance against Set, the merciless god of darkness, who has usurped Egypt\'s throne, plunging the once peaceful and prosperous empire into chaos and conflict.'),
(217, 217, 'Captain America: The Winter Soldier', 'Action,Adventure,Sci-Fi', 'As Steve Rogers struggles to embrace his role in the modern world, he teams up with a fellow Avenger and S.H.I.E.L.D agent, Black Widow, to battle a new threat from history: an assassin known as the Winter Soldier.'),
(218, 218, 'Monster Trucks', 'Action,Adventure,Comedy', 'A young man working at a small town junkyard discovers and befriends a creature which feeds on oil being sought by a fracking company.'),
(219, 219, 'A Dark Song', 'Drama,Horror', 'A determined young woman and a damaged occultist risk their lives and souls to perform a dangerous ritual that will grant them what they want.'),
(220, 220, 'Kick-Ass', 'Action,Comedy', 'Dave Lizewski is an unnoticed high school student and comic book fan who one day decides to become a superhero, even though he has no powers, training or meaningful reason to do so.'),
(221, 221, 'Hardcore Henry', 'Action,Adventure,Sci-Fi', 'Henry is resurrected from death with no memory, and he must save his wife from a telekinetic warlord with a plan to bio-engineer soldiers.'),
(222, 222, 'Cars', 'Animation,Adventure,Comedy', 'A hot-shot race-car named Lightning McQueen gets waylaid in Radiator Springs, where he finds the true meaning of friendship and family.'),
(223, 223, 'It Follows', 'Horror,Mystery', 'A young woman is followed by an unknown supernatural force after a sexual encounter.'),
(224, 224, 'The Girl with the Dragon Tattoo', 'Crime,Drama,Mystery', 'Journalist Mikael Blomkvist is aided in his search for a woman who has been missing for forty years by Lisbeth Salander, a young computer hacker.'),
(225, 225, 'We\'re the Millers', 'Comedy,Crime', 'A veteran pot dealer creates a fake family as part of his plan to move a huge shipment of weed into the U.S. from Mexico.'),
(226, 226, 'American Honey', 'Drama', 'A teenage girl with nothing to lose joins a traveling magazine sales crew, and gets caught up in a whirlwind of hard partying, law bending and young love as she criss-crosses the Midwest with a band of misfits.'),
(227, 227, 'The Lobster', 'Comedy,Drama,Romance', 'In a dystopian near future, single people, according to the laws of The City, are taken to The Hotel, where they are obliged to find a romantic partner in forty-five days or are transformed into beasts and sent off into The Woods.'),
(228, 228, 'Predators', 'Action,Adventure,Sci-Fi', 'A group of elite warriors parachute into an unfamiliar jungle and are hunted by members of a merciless alien race.'),
(229, 229, 'Maleficent', 'Action,Adventure,Family', 'A vengeful fairy is driven to curse an infant princess, only to discover that the child may be the one person who can restore peace to their troubled land.'),
(230, 230, 'Rupture', 'Horror,Sci-Fi,Thriller', 'A single mom tries to break free from a mysterious organization that has abducted her.');
INSERT INTO `movie` (`movie_id`, `Rank`, `Title`, `Genre`, `Description`) VALUES
(231, 231, 'Pan\'s Labyrinth', 'Drama,Fantasy,War', 'In the falangist Spain of 1944, the bookish young stepdaughter of a sadistic army officer escapes into an eerie but captivating fantasy world.'),
(232, 232, 'A Kind of Murder', 'Crime,Drama,Thriller', 'In 1960s New York, Walter Stackhouse is a successful architect married to the beautiful Clara who leads a seemingly perfect life. But his fascination with an unsolved murder leads him into a spiral of chaos as he is forced to play cat-and-mouse with a clever killer and an overambitious detective, while at the same time lusting after another woman.'),
(233, 233, 'Apocalypto', 'Action,Adventure,Drama', 'As the Mayan kingdom faces its decline, the rulers insist the key to prosperity is to build more temples and offer human sacrifices. Jaguar Paw, a young man captured for sacrifice, flees to avoid his fate.'),
(234, 234, 'Mission: Impossible - Rogue Nation', 'Action,Adventure,Thriller', 'Ethan and team take on their most impossible mission yet, eradicating the Syndicate - an International rogue organization as highly skilled as they are, committed to destroying the IMF.'),
(235, 235, 'The Huntsman: Winter\'s War', 'Action,Adventure,Drama', 'Eric and fellow warrior Sara, raised as members of ice Queen Freya\'s army, try to conceal their forbidden love as they fight to survive the wicked intentions of both Freya and her sister Ravenna.'),
(236, 236, 'The Perks of Being a Wallflower', 'Drama,Romance', 'An introvert freshman is taken under the wings of two seniors who welcome him to the real world.'),
(237, 237, 'Jackie', 'Biography,Drama,History', 'Following the assassination of President John F. Kennedy, First Lady Jacqueline Kennedy fights through grief and trauma to regain her faith, console her children, and define her husband\'s historic legacy.'),
(238, 238, 'The Disappointments Room', 'Drama,Horror,Thriller', 'A mother and her young son release unimaginable horrors from the attic of their rural dream home.'),
(239, 239, 'The Grand Budapest Hotel', 'Adventure,Comedy,Drama', 'The adventures of Gustave H, a legendary concierge at a famous hotel from the fictional Republic of Zubrowka between the first and second World Wars, and Zero Moustafa, the lobby boy who becomes his most trusted friend.'),
(240, 240, 'The Host', 'Action,Adventure,Romance', 'When an unseen enemy threatens mankind by taking over their bodies and erasing their memories, Melanie will risk everything to protect the people she cares most about, proving that love can conquer all in a dangerous new world.'),
(241, 241, 'Fury', 'Action,Drama,War', 'A grizzled tank commander makes tough decisions as he and his crew fight their way across Germany in April, 1945.'),
(242, 242, 'Inside Out', 'Animation,Adventure,Comedy', 'After young Riley is uprooted from her Midwest life and moved to San Francisco, her emotions - Joy, Fear, Anger, Disgust and Sadness - conflict on how best to navigate a new city, house, and school.'),
(243, 243, 'Rock Dog', 'Animation,Adventure,Comedy', 'When a radio falls from the sky into the hands of a wide-eyed Tibetan Mastiff, he leaves home to fulfill his dream of becoming a musician, setting into motion a series of completely unexpected events.'),
(244, 244, 'Terminator Genisys', 'Action,Adventure,Sci-Fi', 'When John Connor, leader of the human resistance, sends Sgt. Kyle Reese back to 1984 to protect Sarah Connor and safeguard the future, an unexpected turn of events creates a fractured timeline.'),
(245, 245, 'Percy Jackson & the Olympians: The Lightning Thief', 'Adventure,Family,Fantasy', 'A teenager discovers he\'s the descendant of a Greek god and sets out on an adventure to settle an on-going battle between the gods.'),
(246, 246, 'Les Misrables', 'Drama,Musical,Romance', 'In 19th-century France, Jean Valjean, who for decades has been hunted by the ruthless policeman Javert after breaking parole, agrees to care for a factory worker\'s daughter. The decision changes their lives forever.'),
(247, 247, 'Children of Men', 'Drama,Sci-Fi,Thriller', 'In 2027, in a chaotic world in which women have become somehow infertile, a former activist agrees to help transport a miraculously pregnant woman to a sanctuary at sea.'),
(248, 248, '20th Century Women', 'Comedy,Drama', 'The story of a teenage boy, his mother, and two other women who help raise him among the love and freedom of Southern California of 1979.'),
(249, 249, 'Spy', 'Action,Comedy,Crime', 'A desk-bound CIA analyst volunteers to go undercover to infiltrate the world of a deadly arms dealer, and prevent diabolical global disaster.'),
(250, 250, 'The Intouchables', 'Biography,Comedy,Drama', 'After he becomes a quadriplegic from a paragliding accident, an aristocrat hires a young man from the projects to be his caregiver.'),
(251, 251, 'Bonjour Anne', 'Comedy,Drama,Romance', 'Anne is at a crossroads in her life. Long married to a successful, driven but inattentive movie producer, she unexpectedly finds herself taking a car trip from Cannes to Paris with a ... See full summary ?'),
(252, 252, 'Kynodontas', 'Drama,Thriller', 'Three teenagers live isolated, without leaving their house, because their over-protective parents say they can only leave when their dogtooth falls out.'),
(253, 253, 'Straight Outta Compton', 'Biography,Drama,History', 'The group NWA emerges from the mean streets of Compton in Los Angeles, California, in the mid-1980s and revolutionizes Hip Hop culture with their music and tales about life in the hood.'),
(254, 254, 'The Amazing Spider-Man 2', 'Action,Adventure,Sci-Fi', 'When New York is put under siege by Oscorp, it is up to Spider-Man to save the city he swore to protect as well as his loved ones.'),
(255, 255, 'The Conjuring', 'Horror,Mystery,Thriller', 'Paranormal investigators Ed and Lorraine Warren work to help a family terrorized by a dark presence in their farmhouse.'),
(256, 256, 'The Hangover', 'Comedy', 'Three buddies wake up from a bachelor party in Las Vegas, with no memory of the previous night and the bachelor missing. They make their way around the city in order to find their friend before his wedding.'),
(257, 257, 'Battleship', 'Action,Adventure,Sci-Fi', 'A fleet of ships is forced to do battle with an armada of unknown origins in order to discover and thwart their destructive goals.'),
(258, 258, 'Rise of the Planet of the Apes', 'Action,Drama,Sci-Fi', 'A substance, designed to help the brain repair itself, gives rise to a super-intelligent chimp who leads an ape uprising.'),
(259, 259, 'Lights Out', 'Horror', 'Rebecca must unlock the terror behind her little brother\'s experiences that once tested her sanity, bringing her face to face with an entity attached to their mother.'),
(260, 260, 'Norman: The Moderate Rise and Tragic Fall of a New York Fixer', 'Drama,Thriller', 'Norman Oppenheimer is a small time operator who befriends a young politician at a low point in his life. Three years later, when the politician becomes an influential world leader, Norman\'s life dramatically changes for better and worse.'),
(261, 261, 'Birdman or (The Unexpected Virtue of Ignorance)', 'Comedy,Drama,Romance', 'Illustrated upon the progress of his latest Broadway play, a former popular actor\'s struggle to cope with his current life as a wasted actor is shown.'),
(262, 262, 'Black Swan', 'Drama,Thriller', 'A committed dancer wins the lead role in a production of Tchaikovsky\'s \"Swan Lake\" only to find herself struggling to maintain her sanity.'),
(263, 263, 'Dear White People', 'Comedy,Drama', 'The lives of four black students at an Ivy League college.'),
(264, 264, 'Nymphomaniac: Vol. I', 'Drama', 'A self-diagnosed nymphomaniac recounts her erotic experiences to the man who saved her after a beating.'),
(265, 265, 'Teenage Mutant Ninja Turtles: Out of the Shadows', 'Action,Adventure,Comedy', 'After facing Shredder, who has joined forces with mad scientist Baxter Stockman and henchmen Bebop and Rocksteady to take over the world, the Turtles must confront an even greater nemesis: the notorious Krang.'),
(266, 266, 'Knock Knock', 'Drama,Horror,Thriller', 'A devoted father helps two stranded young women who knock on his door, but his kind gesture turns into a dangerous seduction and a deadly game of cat and mouse.'),
(267, 267, 'Dirty Grandpa', 'Comedy', 'Right before his wedding, an uptight guy is tricked into driving his grandfather, a lecherous former Army Lieutenant-Colonel, to Florida for spring break.'),
(268, 268, 'Cloud Atlas', 'Drama,Sci-Fi', 'An exploration of how the actions of individual lives impact one another in the past, present and future, as one soul is shaped from a killer into a hero, and an act of kindness ripples across centuries to inspire a revolution.'),
(269, 269, 'X-Men Origins: Wolverine', 'Action,Adventure,Sci-Fi', 'A look at Wolverine\'s early life, in particular his time with the government squad Team X and the impact it will have on his later years.'),
(270, 270, 'Satanic', 'Horror', 'Four friends on their way to Coachella stop off in Los Angeles to tour true-crime occult sites, only to encounter a mysterious young runaway who puts them on a terrifying path to ultimate horror.'),
(271, 271, 'Skyfall', 'Action,Adventure,Thriller', 'Bond\'s loyalty to M is tested when her past comes back to haunt her. Whilst MI6 comes under attack, 007 must track down and destroy the threat, no matter how personal the cost.'),
(272, 272, 'The Hobbit: An Unexpected Journey', 'Adventure,Fantasy', 'A reluctant hobbit, Bilbo Baggins, sets out to the Lonely Mountain with a spirited group of dwarves to reclaim their mountain home - and the gold within it - from the dragon Smaug.'),
(273, 273, '21 Jump Street', 'Action,Comedy,Crime', 'A pair of underachieving cops are sent back to a local high school to blend in and bring down a synthetic drug ring.'),
(274, 274, 'Sing Street', 'Comedy,Drama,Music', 'A boy growing up in Dublin during the 1980s escapes his strained family life by starting a band to impress the mysterious girl he likes.'),
(275, 275, 'Ballerina', 'Animation,Adventure,Comedy', 'An orphan girl dreams of becoming a ballerina and flees her rural Brittany for Paris, where she passes for someone else and accedes to the position of pupil at the Grand Opera house.'),
(276, 276, 'Oblivion', 'Action,Adventure,Mystery', 'A veteran assigned to extract Earth\'s remaining resources begins to question what he knows about his mission and himself.'),
(277, 277, '22 Jump Street', 'Action,Comedy,Crime', 'After making their way through high school (twice), big changes are in store for officers Schmidt and Jenko when they go deep undercover at a local college.'),
(278, 278, 'Zodiac', 'Crime,Drama,History', 'In the late 1960s/early 1970s, a San Francisco cartoonist becomes an amateur detective obsessed with tracking down the Zodiac Killer, an unidentified individual who terrorizes Northern California with a killing spree.'),
(279, 279, 'Everybody Wants Some!!', 'Comedy', 'In 1980, a group of college baseball players navigate their way through the freedoms and responsibilities of unsupervised adulthood.'),
(280, 280, 'Iron Man Three', 'Action,Adventure,Sci-Fi', 'When Tony Stark\'s world is torn apart by a formidable terrorist called the Mandarin, he starts an odyssey of rebuilding and retribution.'),
(281, 281, 'Now You See Me', 'Crime,Mystery,Thriller', 'An FBI agent and an Interpol detective track a team of illusionists who pull off bank heists during their performances and reward their audiences with the money.'),
(282, 282, 'Sherlock Holmes', 'Action,Adventure,Crime', 'Detective Sherlock Holmes and his stalwart partner Watson engage in a battle of wits and brawn with a nemesis whose plot is a threat to all of England.'),
(283, 283, 'Death Proof', 'Thriller', 'Two separate sets of voluptuous women are stalked at different times by a scarred stuntman who uses his \"death proof\" cars to execute his murderous plans.'),
(284, 284, 'The Danish Girl', 'Biography,Drama,Romance', 'A fictitious love story loosely inspired by the lives of Danish artists Lili Elbe and Gerda Wegener. Lili and Gerda\'s marriage and work evolve as they navigate Lili\'s groundbreaking journey as a transgender pioneer.'),
(285, 285, 'Hercules', 'Action,Adventure', 'Having endured his legendary twelve labors, Hercules, the Greek demigod, has his life as a sword-for-hire tested when the King of Thrace and his daughter seek his aid in defeating a tyrannical warlord.'),
(286, 286, 'Sucker Punch', 'Action,Fantasy', 'A young girl is institutionalized by her abusive stepfather, retreating to an alternative reality as a coping strategy, envisioning a plan to help her escape.'),
(287, 287, 'Keeping Up with the Joneses', 'Action,Comedy', 'A suburban couple becomes embroiled in an international espionage plot when they discover that their seemingly perfect new neighbors are government spies.'),
(288, 288, 'Jupiter Ascending', 'Action,Adventure,Sci-Fi', 'A young woman discovers her destiny as an heiress of intergalactic nobility and must fight to protect the inhabitants of Earth from an ancient and destructive industry.'),
(289, 289, 'Masterminds', 'Action,Comedy,Crime', 'A guard at an armored car company in the Southern U.S. organizes one of the biggest bank heists in American history. Based on the October 1997 Loomis Fargo robbery.'),
(290, 290, 'Iris', 'Thriller', 'Iris, young wife of a businessman, disappears in Paris. Maybe a mechanic with many debts is involved in the strange affair. A really complicated job for the police.'),
(291, 291, 'Busanhaeng', 'Action,Drama,Horror', 'While a zombie virus breaks out in South Korea, passengers struggle to survive on the train from Seoul to Busan.'),
(292, 292, 'Pitch Perfect', 'Comedy,Music,Romance', 'Beca, a freshman at Barden University, is cajoled into joining The Bellas, her school\'s all-girls singing group. Injecting some much needed energy into their repertoire, The Bellas take on their male rivals in a campus competition.'),
(293, 293, 'Neighbors 2: Sorority Rising', 'Comedy', 'When their new next-door neighbors turn out to be a sorority even more debaucherous than the fraternity previously living there, Mac and Kelly team with their former enemy, Teddy, to bring the girls down.'),
(294, 294, 'The Exception', 'Drama', 'A German soldier tries to determine if the Dutch resistance has planted a spy to infiltrate the home of Kaiser Wilhelm in Holland during the onset of World War II, but falls for a young Jewish Dutch woman during his investigation.'),
(295, 295, 'Man of Steel', 'Action,Adventure,Fantasy', 'Clark Kent, one of the last of an extinguished race disguised as an unremarkable human, is forced to reveal his identity when Earth is invaded by an army of survivors who threaten to bring the planet to the brink of destruction.'),
(296, 296, 'The Choice', 'Drama,Romance', 'Travis and Gabby first meet as neighbors in a small coastal town and wind up in a relationship that is tested by life\'s most defining events.'),
(297, 297, 'Ice Age: Collision Course', 'Animation,Adventure,Comedy', 'Manny, Diego, and Sid join up with Buck to fend off a meteor strike that would destroy the world.'),
(298, 298, 'The Devil Wears Prada', 'Comedy,Drama', 'A smart but sensible new graduate lands a job as an assistant to Miranda Priestly, the demanding editor-in-chief of a high fashion magazine.'),
(299, 299, 'The Infiltrator', 'Biography,Crime,Drama', 'A U.S. Customs official uncovers a money laundering scheme involving Colombian drug lord Pablo Escobar.'),
(300, 300, 'There Will Be Blood', 'Drama,History', 'A story of family, religion, hatred, oil and madness, focusing on a turn-of-the-century prospector in the early days of the business.'),
(301, 301, 'The Equalizer', 'Action,Crime,Thriller', 'A man believes he has put his mysterious past behind him and has dedicated himself to beginning a new, quiet life. But when he meets a young girl under the control of ultra-violent Russian gangsters, he can\'t stand idly by - he has to help her.'),
(302, 302, 'Lone Survivor', 'Action,Biography,Drama', 'Marcus Luttrell and his team set out on a mission to capture or kill notorious Taliban leader Ahmad Shah, in late June 2005. Marcus and his team are left to fight for their lives in one of the most valiant efforts of modern warfare.'),
(303, 303, 'The Cabin in the Woods', 'Horror', 'Five friends go for a break at a remote cabin, where they get more than they bargained for, discovering the truth behind the cabin in the woods.'),
(304, 304, 'The House Bunny', 'Comedy,Romance', 'After Playboy bunny Shelley is kicked out of the playboy mansion, she finds a job as the house mother for a sorority full of socially awkward girls.'),
(305, 305, 'She\'s Out of My League', 'Comedy,Romance', 'An average Joe meets the perfect woman, but his lack of confidence and the influence of his friends and family begin to pick away at the relationship.'),
(306, 306, 'Inherent Vice', 'Comedy,Crime,Drama', 'In 1970, drug-fueled Los Angeles private investigator Larry \"Doc\" Sportello investigates the disappearance of a former girlfriend.'),
(307, 307, 'Alice Through the Looking Glass', 'Adventure,Family,Fantasy', 'Alice returns to the whimsical world of Wonderland and travels back in time to help the Mad Hatter.'),
(308, 308, 'Vincent N Roxxy', 'Crime,Drama,Thriller', 'A small town loner and a rebellious punk rocker unexpectedly fall in love as they are forced on the run and soon discover violence follows them everywhere.'),
(309, 309, 'The Fast and the Furious: Tokyo Drift', 'Action,Crime,Thriller', 'A teenager becomes a major competitor in the world of drift racing after moving in with his father in Tokyo to avoid a jail sentence in America.'),
(310, 310, 'How to Be Single', 'Comedy,Romance', 'A group of young adults navigate love and relationships in New York City.'),
(311, 311, 'The Blind Side', 'Biography,Drama,Sport', 'The story of Michael Oher, a homeless and traumatized boy who became an All American football player and first round NFL draft pick with the help of a caring woman and her family.'),
(312, 312, 'La vie d\'Adle', 'Drama,Romance', 'Adle\'s life is changed when she meets Emma, a young woman with blue hair, who will allow her to discover desire and to assert herself as a woman and as an adult. In front of others, Adle grows, seeks herself, loses herself, and ultimately finds herself through love and loss.'),
(313, 313, 'The Babadook', 'Drama,Horror', 'A single mother, plagued by the violent death of her husband, battles with her son\'s fear of a monster lurking in the house, but soon discovers a sinister presence all around her.'),
(314, 314, 'The Hobbit: The Battle of the Five Armies', 'Adventure,Fantasy', 'Bilbo and Company are forced to engage in a war against an array of combatants and keep the Lonely Mountain from falling into the hands of a rising darkness.'),
(315, 315, 'Harry Potter and the Order of the Phoenix', 'Adventure,Family,Fantasy', 'With their warning about Lord Voldemort\'s return scoffed at, Harry and Dumbledore are targeted by the Wizard authorities as an authoritarian bureaucrat slowly seizes power at Hogwarts.'),
(316, 316, 'Snowpiercer', 'Action,Drama,Sci-Fi', 'Set in a future where a failed climate-change experiment kills all life on the planet except for a lucky few who boarded the Snowpiercer, a train that travels around the globe, where a class system emerges.'),
(317, 317, 'The 5th Wave', 'Action,Adventure,Sci-Fi', 'Four waves of increasingly deadly alien attacks have left most of Earth decimated. Cassie is on the run, desperately trying to save her younger brother.'),
(318, 318, 'The Stakelander', 'Action,Horror', 'When his home of New Eden is destroyed by a revitalized Brotherhood and its new Vamp leader, Martin finds himself alone in the badlands of America with only the distant memory of his mentor and legendary vampire hunter, Mister, to guide him.'),
(319, 319, 'The Visit', 'Comedy,Horror,Thriller', 'Two siblings become increasingly frightened by their grandparents\' disturbing behavior while visiting them on vacation.'),
(320, 320, 'Fast Five', 'Action,Crime,Thriller', 'Dominic Toretto and his crew of street racers plan a massive heist to buy their freedom while in the sights of a powerful Brazilian drug lord and a dangerous federal agent.'),
(321, 321, 'Step Up', 'Crime,Drama,Music', 'Tyler Gage receives the opportunity of a lifetime after vandalizing a performing arts school, gaining him the chance to earn a scholarship and dance with an up and coming dancer, Nora.'),
(322, 322, 'Lovesong', 'Drama', 'The relationship between two friends deepens during an impromptu road trip.'),
(323, 323, 'RocknRolla', 'Action,Crime,Thriller', 'In London, a real-estate scam puts millions of pounds up for grabs, attracting some of the city\'s scrappiest tough guys and its more established underworld types, all of whom are looking to get rich quick. While the city\'s seasoned criminals vie for the cash, an unexpected player -- a drugged-out rock \'n\' roller presumed to be dead but very much alive -- has a multi-million-dollar prize fall into... See full summary ?'),
(324, 324, 'In Time', 'Action,Sci-Fi,Thriller', 'In a future where people stop aging at 25, but are engineered to live only one more year, having the means to buy your way out of the situation is a shot at immortal youth. Here, Will Salas finds himself accused of murder and on the run with a hostage - a connection that becomes an important part of the way against the system.'),
(325, 325, 'The Social Network', 'Biography,Drama', 'Harvard student Mark Zuckerberg creates the social networking site that would become known as Facebook, but is later sued by two brothers who claimed he stole their idea, and the co-founder who was later squeezed out of the business.'),
(326, 326, 'The Last Witch Hunter', 'Action,Adventure,Fantasy', 'The last witch hunter is all that stands between humanity and the combined forces of the most horrifying witches in history.'),
(327, 327, 'Victor Frankenstein', 'Drama,Horror,Sci-Fi', 'Told from Igor\'s perspective, we see the troubled young assistant\'s dark origins, his redemptive friendship with the young medical student Viktor Von Frankenstein, and become eyewitnesses to the emergence of how Frankenstein became the man - and the legend - we know today.'),
(328, 328, 'A Street Cat Named Bob', 'Biography,Comedy,Drama', 'Based on the international best selling book. The true feel good story of how James Bowen, a busker and recovering drug addict, had his life transformed when he met a stray ginger cat.'),
(329, 329, 'Green Room', 'Crime,Horror,Thriller', 'A punk rock band is forced to fight for survival after witnessing a murder at a neo-Nazi skinhead bar.'),
(330, 330, 'Blackhat', 'Crime,Drama,Mystery', 'A furloughed convict and his American and Chinese partners hunt a high-level cybercrime network from Chicago to Los Angeles to Hong Kong to Jakarta.'),
(331, 331, 'Storks', 'Animation,Adventure,Comedy', 'Storks have moved on from delivering babies to packages. But when an order for a baby appears, the best delivery stork must scramble to fix the error by delivering the baby.'),
(332, 332, 'American Sniper', 'Action,Biography,Drama', 'Navy S.E.A.L. sniper Chris Kyle\'s pinpoint accuracy saves countless lives on the battlefield and turns him into a legend. Back home to his wife and kids after four tours of duty, however, Chris finds that it is the war he can\'t leave behind.'),
(333, 333, 'Dallas Buyers Club', 'Biography,Drama', 'In 1985 Dallas, electrician and hustler Ron Woodroof works around the system to help AIDS patients get the medication they need after he is diagnosed with the disease.'),
(334, 334, 'Lincoln', 'Biography,Drama,History', 'As the War continues to rage, America\'s president struggles with continuing carnage on the battlefield as he fights with many inside his own cabinet on the decision to emancipate the slaves.'),
(335, 335, 'Rush', 'Action,Biography,Drama', 'The merciless 1970s rivalry between Formula One rivals James Hunt and Niki Lauda.'),
(336, 336, 'Before I Wake', 'Drama,Fantasy,Horror', 'A young couple adopt an orphaned child whose dreams - and nightmares - manifest physically as he sleeps.'),
(337, 337, 'Silver Linings Playbook', 'Comedy,Drama,Romance', 'After a stint in a mental institution, former teacher Pat Solitano moves back in with his parents and tries to reconcile with his ex-wife. Things get more challenging when Pat meets Tiffany, a mysterious girl with problems of her own.'),
(338, 338, 'Tracktown', 'Drama,Sport', 'A young, talented, and lonely long-distance runner twists her ankle as she prepares for the Olympic Trials and must do something she\'s never done before: take a day off.'),
(339, 339, 'The Fault in Our Stars', 'Drama,Romance', 'Two teenage cancer patients begin a life-affirming journey to visit a reclusive author in Amsterdam.'),
(340, 340, 'Blended', 'Comedy,Romance', 'After a bad blind date, a man and woman find themselves stuck together at a resort for families, where their attraction grows as their respective kids benefit from the burgeoning relationship.'),
(341, 341, 'Fast & Furious', 'Action,Crime,Thriller', 'Brian O\'Conner, back working for the FBI in Los Angeles, teams up with Dominic Toretto to bring down a heroin importer by infiltrating his operation.'),
(342, 342, 'Looper', 'Action,Crime,Drama', 'In 2074, when the mob wants to get rid of someone, the target is sent into the past, where a hired gun awaits - someone like Joe - who one day learns the mob wants to \'close the loop\' by sending back Joe\'s future self for assassination.'),
(343, 343, 'White House Down', 'Action,Drama,Thriller', 'While on a tour of the White House with his young daughter, a Capitol policeman springs into action to save his child and protect the president from a heavily armed group of paramilitary invaders.'),
(344, 344, 'Pete\'s Dragon', 'Adventure,Family,Fantasy', 'The adventures of an orphaned boy named Pete and his best friend Elliot, who just so happens to be a dragon.'),
(345, 345, 'Spider-Man 3', 'Action,Adventure', 'A strange black entity from another world bonds with Peter Parker and causes inner turmoil as he contends with new villains, temptations, and revenge.'),
(346, 346, 'The Three Musketeers', 'Action,Adventure,Romance', 'The hot-headed young D\'Artagnan along with three former legendary but now down on their luck Musketeers must unite and defeat a beautiful double agent and her villainous employer from seizing the French throne and engulfing Europe in war.'),
(347, 347, 'Stardust', 'Adventure,Family,Fantasy', 'In a countryside town bordering on a magical land, a young man makes a promise to his beloved that he\'ll retrieve a fallen star by venturing into the magical realm.'),
(348, 348, 'American Hustle', 'Crime,Drama', 'A con man, Irving Rosenfeld, along with his seductive partner Sydney Prosser, is forced to work for a wild FBI agent, Richie DiMaso, who pushes them into a world of Jersey powerbrokers and mafia.'),
(349, 349, 'Jennifer\'s Body', 'Comedy,Horror', 'A newly possessed high school cheerleader turns into a succubus who specializes in killing her male classmates. Can her best friend put an end to the horror?'),
(350, 350, 'Midnight in Paris', 'Comedy,Fantasy,Romance', 'While on a trip to Paris with his fiance\'s family, a nostalgic screenwriter finds himself mysteriously going back to the 1920s everyday at midnight.'),
(351, 351, 'Lady Macbeth', 'Drama', 'Set in 19th century rural England, young bride who has been sold into marriage to a middle-aged man discovers an unstoppable desire within herself as she enters into an affair with a work on her estate.'),
(352, 352, 'Joy', 'Drama', 'Joy is the story of the title character, who rose to become founder and matriarch of a powerful family business dynasty.'),
(353, 353, 'The Dressmaker', 'Comedy,Drama', 'A glamorous woman returns to her small town in rural Australia. With her sewing machine and haute couture style, she transforms the women and exacts sweet revenge on those who did her wrong.'),
(354, 354, 'Caf Society', 'Comedy,Drama,Romance', 'In the 1930s, a Bronx native moves to Hollywood and falls in love with a young woman who is seeing a married man.'),
(355, 355, 'Insurgent', 'Adventure,Sci-Fi,Thriller', 'Beatrice Prior must confront her inner demons and continue her fight against a powerful alliance which threatens to tear her society apart with the help from others on her side.'),
(356, 356, 'Seventh Son', 'Action,Adventure,Fantasy', 'When Mother Malkin, the queen of evil witches, escapes the pit she was imprisoned in by professional monster hunter Spook decades ago and kills his apprentice, he recruits young Tom, the seventh son of the seventh son, to help him.'),
(357, 357, 'Demain tout commence', 'Comedy,Drama', 'Samuel parties hard in the Marseille area of France and is awoken one morning by a woman carrying a baby she claims is his. She drives off leaving him with a wailing infant; he gives chase ... See full summary ?'),
(358, 358, 'The Theory of Everything', 'Biography,Drama,Romance', 'A look at the relationship between the famous physicist Stephen Hawking and his wife.'),
(359, 359, 'This Is the End', 'Comedy,Fantasy', 'While attending a party at James Franco\'s house, Seth Rogen, Jay Baruchel and many other celebrities are faced with the Biblical Apocalypse.'),
(360, 360, 'About Time', 'Comedy,Drama,Fantasy', 'At the age of 21, Tim discovers he can travel in time and change what happens and has happened in his own life. His decision to make his world a better place by getting a girlfriend turns out not to be as easy as you might think.'),
(361, 361, 'Step Brothers', 'Comedy', 'Two aimless middle-aged losers still living at home are forced against their will to become roommates when their parents marry.'),
(362, 362, 'Clown', 'Horror,Thriller', 'A loving father finds a clown suit for his son\'s birthday party, only to realize that it is not a suit at all.'),
(363, 363, 'Star Trek Into Darkness', 'Action,Adventure,Sci-Fi', 'After the crew of the Enterprise find an unstoppable force of terror from within their own organization, Captain Kirk leads a manhunt to a war-zone world to capture a one-man weapon of mass destruction.'),
(364, 364, 'Zombieland', 'Adventure,Comedy,Horror', 'A shy student trying to reach his family in Ohio, a gun-toting tough guy trying to find the last Twinkie, and a pair of sisters trying to get to an amusement park join forces to travel across a zombie-filled America.'),
(365, 365, 'Hail, Caesar!', 'Comedy,Mystery', 'A Hollywood fixer in the 1950s works to keep the studio\'s stars in line.'),
(366, 366, 'Slumdog Millionaire', 'Drama', 'A Mumbai teen reflects on his upbringing in the slums when he is accused of cheating on the Indian Version of \"Who Wants to be a Millionaire?\"'),
(367, 367, 'The Twilight Saga: Breaking Dawn - Part 2', 'Adventure,Drama,Fantasy', 'After the birth of Renesmee, the Cullens gather other vampire clans in order to protect the child from a false allegation that puts the family in front of the Volturi.'),
(368, 368, 'American Wrestler: The Wizard', 'Drama,Sport', 'In 1980, a teenage boy escapes the unrest in Iran only to face more hostility in America, due to the hostage crisis. Determined to fit in, he joins the school\'s floundering wrestling team.'),
(369, 369, 'The Amazing Spider-Man', 'Action,Adventure', 'After Peter Parker is bitten by a genetically altered spider, he gains newfound, spider-like powers and ventures out to solve the mystery of his parent\'s mysterious death.'),
(370, 370, 'Ben-Hur', 'Action,Adventure,Drama', 'Judah Ben-Hur, a prince falsely accused of treason by his adopted brother, an officer in the Roman army, returns to his homeland after years at sea to seek revenge, but finds redemption.'),
(371, 371, 'Sleight', 'Action,Drama,Sci-Fi', 'A young street magician (Jacob Latimore) is left to care for his little sister after their parents passing, and turns to illegal activities to keep a roof over their heads. When he gets in ... See full summary ?'),
