(373, 373, 'Criminal', 'Action,Crime,Drama', 'In a last-ditch effort to stop a diabolical plot, a dead CIA operative\'s memories, secrets, and skills are implanted into a death-row inmate in hopes that he will complete the operative\'s mission.'),
(374, 374, 'Wanted', 'Action,Crime,Fantasy', 'A frustrated office worker learns that he is the son of a professional assassin, and that he shares his father\'s superhuman killing abilities.'),
(375, 375, 'Florence Foster Jenkins', 'Biography,Comedy,Drama', 'The story of Florence Foster Jenkins, a New York heiress who dreamed of becoming an opera singer, despite having a terrible singing voice.'),
(376, 376, 'Collide', 'Action,Crime,Thriller', 'An American backpacker gets involved with a ring of drug smugglers as their driver, though he winds up on the run from his employers across Cologne high-speed Autobahn.'),
(377, 377, 'Black Mass', 'Biography,Crime,Drama', 'The true story of Whitey Bulger, the brother of a state senator and the most infamous violent criminal in the history of South Boston, who became an FBI informant to take down a Mafia family invading his turf.'),
