(379, 379, 'Swiss Army Man', 'Adventure,Comedy,Drama', 'A hopeless man stranded on a deserted island befriends a dead body and together they go on a surreal journey to get home.'),
(380, 380, 'The Expendables 3', 'Action,Adventure,Thriller', 'Barney augments his team with new blood for a personal battle: to take down Conrad Stonebanks, the Expendables co-founder and notorious arms trader who is hell bent on wiping out Barney and every single one of his associates.'),
(381, 381, 'What We Do in the Shadows', 'Comedy,Fantasy,Horror', 'A documentary team films the lives of a group of vampires for a few months. The vampires share a house in Wellington, New Zealand. Turns out vampires have their own domestic problems too.'),
