(383, 383, 'Hush', 'Horror,Thriller', 'A deaf writer who retreated into the woods to live a solitary life must fight for her life in silence when a masked killer appears at her window.'),
(384, 384, 'Bridge of Spies', 'Drama,History,Thriller', 'During the Cold War, an American lawyer is recruited to defend an arrested Soviet spy in court, and then help the CIA facilitate an exchange of the spy for the Soviet captured American U2 spy plane pilot, Francis Gary Powers.'),
(385, 385, 'The Lego Movie', 'Animation,Action,Adventure', 'An ordinary Lego construction worker, thought to be the prophesied \'Special\', is recruited to join a quest to stop an evil tyrant from gluing the Lego universe into eternal stasis.'),
(386, 386, 'Everest', 'Action,Adventure,Drama', 'The story of New Zealand\'s Robert \"Rob\" Edwin Hall, who on May 10, 1996, together with Scott Fischer, teamed up on a joint expedition to ascend Mount Everest.'),
(387, 387, 'Pixels', 'Action,Comedy,Family', 'When aliens misinterpret video feeds of classic arcade games as a declaration of war, they attack the Earth in the form of the video games.'),
(388, 388, 'Robin Hood', 'Action,Adventure,Drama', 'In 12th century England, Robin and his band of marauders confront corruption in a local village and lead an uprising against the crown that will forever alter the balance of world power.'),
(389, 389, 'The Wolverine', 'Action,Adventure,Sci-Fi', 'When Wolverine is summoned to Japan by an old acquaintance, he is embroiled in a conflict that forces him to confront his own demons.'),
(390, 390, 'John Carter', 'Action,Adventure,Sci-Fi', 'Transported to Barsoom, a Civil War vet discovers a barren planet seemingly inhabited by 12-foot tall barbarians. Finding himself prisoner of these creatures, he escapes, only to encounter Woola and a princess in desperate need of a savior.'),
