(392, 392, 'The Gunman', 'Action,Crime,Drama', 'A sniper on a mercenary assassination team, kills the minister of mines of the Congo. Terrier\'s successful kill shot forces him into hiding. Returning to the Congo years later, he becomes the target of a hit squad himself.'),
(393, 393, 'Steve Jobs', 'Biography,Drama', 'Steve Jobs takes us behind the scenes of the digital revolution, to paint a portrait of the man at its epicenter. The story unfolds backstage at three iconic product launches, ending in 1998 with the unveiling of the iMac.'),
(394, 394, 'Whisky Galore', 'Comedy,Romance', 'Scottish islanders try to plunder cases of whisky from a stranded ship.'),
(395, 395, 'Grown Ups 2', 'Comedy', 'After moving his family back to his hometown to be with his friends and their kids, Lenny finds out that between old bullies, new bullies, schizo bus drivers, drunk cops on skis, and 400 costumed party crashers sometimes crazy follows you.'),
(396, 396, 'The Age of Adaline', 'Drama,Fantasy,Romance', 'A young woman, born at the turn of the 20th century, is rendered ageless after an accident. After many solitary years, she meets a man who complicates the eternal life she has settled into.'),
(397, 397, 'The Incredible Hulk', 'Action,Adventure,Sci-Fi', 'Bruce Banner, a scientist on the run from the U.S. Government, must find a cure for the monster he emerges whenever he loses his temper.'),
(398, 398, 'Couples Retreat', 'Comedy', 'A comedy centered around four couples who settle into a tropical-island resort for a vacation. While one of the couples is there to work on the marriage, the others fail to realize that participation in the resort\'s therapy sessions is not optional.'),
(399, 399, 'Absolutely Anything', 'Comedy,Sci-Fi', 'A group of eccentric aliens confer a human being with the power to do absolutely anything, as an experiment.'),
(400, 400, 'Magic Mike', 'Comedy,Drama', 'A male stripper teaches a younger performer how to party, pick up women, and make easy money.'),
(401, 401, 'Minions', 'Animation,Action,Adventure', 'Minions Stuart, Kevin and Bob are recruited by Scarlet Overkill, a super-villain who, alongside her inventor husband Herb, hatches a plot to take over the world.'),
(402, 402, 'The Black Room', 'Horror', 'PAUL and JENNIFER HEMDALE have just moved into their dream house. But their happy marriage is about to be put to the test as they slowly discover the secret behind the black room in the ... See full summary ?'),
(403, 403, 'Bronson', 'Action,Biography,Crime', 'A young man who was sentenced to seven years in prison for robbing a post office ends up spending three decades in solitary confinement. During this time, his own personality is supplanted by his alter-ego, Charles Bronson.'),
(404, 404, 'Despicable Me', 'Animation,Adventure,Comedy', 'When a criminal mastermind uses a trio of orphan girls as pawns for a grand scheme, he finds their love is profoundly changing him for the better.'),
(405, 405, 'The Best of Me', 'Drama,Romance', 'A pair of former high school sweethearts reunite after many years when they return to visit their small hometown.'),
(406, 406, 'The Invitation', 'Drama,Mystery,Thriller', 'While attending a dinner party at his former home, a man thinks his ex-wife and her new husband have sinister intentions for their guests.'),
(407, 407, 'Zero Dark Thirty', 'Drama,History,Thriller', 'A chronicle of the decade-long hunt for al-Qaeda terrorist leader Osama bin Laden after the September 2001 attacks, and his death at the hands of the Navy S.E.A.L.s Team 6 in May 2011.'),
(408, 408, 'Tangled', 'Animation,Adventure,Comedy', 'The magically long-haired Rapunzel has spent her entire life in a tower, but now that a runaway thief has stumbled upon her, she is about to discover the world for the first time, and who she really is.'),
(409, 409, 'The Hunger Games: Mockingjay - Part 2', 'Action,Adventure,Sci-Fi', 'As the war of Panem escalates to the destruction of other districts, Katniss Everdeen, the reluctant leader of the rebellion, must bring together an army against President Snow, while all she holds dear hangs in the balance.'),
(410, 410, 'Vacation', 'Adventure,Comedy', 'Rusty Griswold takes his own family on a road trip to \"Walley World\" in order to spice things up with his wife and reconnect with his sons.'),
(411, 411, 'Taken', 'Action,Thriller', 'A retired CIA agent travels across Europe and relies on his old skills to save his estranged daughter, who has been kidnapped while on a trip to Paris.'),
(412, 412, 'Pitch Perfect 2', 'Comedy,Music', 'After a humiliating command performance at The Kennedy Center, the Barden Bellas enter an international competition that no American group has ever won in order to regain their status and right to perform.'),
(413, 413, 'Monsters University', 'Animation,Adventure,Comedy', 'A look at the relationship between Mike and Sulley during their days at Monsters University -- when they weren\'t necessarily the best of friends.'),
(414, 414, 'Elle', 'Crime,Drama,Thriller', 'A successful businesswoman gets caught up in a game of cat and mouse as she tracks down the unknown man who raped her.'),
(415, 415, 'Mechanic: Resurrection', 'Action,Adventure,Crime', 'Arthur Bishop thought he had put his murderous past behind him, until his most formidable foe kidnaps the love of his life. Now he is forced to travel the globe to complete three impossible assassinations, and do what he does best: make them look like accidents.'),
(416, 416, 'Tusk', 'Comedy,Drama,Horror', 'When podcaster Wallace Bryton goes missing in the backwoods of Manitoba while interviewing a mysterious seafarer named Howard Howe, his best friend Teddy and girlfriend Allison team with an ex-cop to look for him.'),
(417, 417, 'The Headhunter\'s Calling', 'Drama', 'A headhunter whose life revolves around closing deals in a a survival-of-the-fittest boiler room, battles his top rival for control of their job placement company -- his dream of owning the company clashing with the needs of his family.'),
(418, 418, 'Atonement', 'Drama,Mystery,Romance', 'Fledgling writer Briony Tallis, as a thirteen-year-old, irrevocably changes the course of several lives when she accuses her older sister\'s lover of a crime he did not commit.'),
(419, 419, 'Harry Potter and the Deathly Hallows: Part 1', 'Adventure,Family,Fantasy', 'As Harry races against time and evil to destroy the Horcruxes, he uncovers the existence of three most powerful objects in the wizarding world: the Deathly Hallows.'),
(420, 420, 'Shame', 'Drama', 'A man\'s carefully cultivated private life is disrupted when his sister arrives for an indefinite stay.'),
(421, 421, 'Hanna', 'Action,Drama,Thriller', 'A sixteen-year-old girl who was raised by her father to be the perfect assassin is dispatched on a mission across Europe, tracked by a ruthless intelligence agent and her operatives.'),
(422, 422, 'The Babysitters', 'Drama', 'A teenager turns her babysitting service into a call-girl service for married guys after fooling around with one of her customers.'),
(423, 423, 'Pride and Prejudice and Zombies', 'Action,Horror,Romance', 'Five sisters in 19th century England must cope with the pressures to marry while protecting themselves from a growing population of zombies.'),
(424, 424, '300: Rise of an Empire', 'Action,Drama,Fantasy', 'Greek general Themistokles leads the charge against invading Persian forces led by mortal-turned-god Xerxes and Artemisia, vengeful commander of the Persian navy.'),
(425, 425, 'London Has Fallen', 'Action,Crime,Drama', 'In London for the Prime Minister\'s funeral, Mike Banning discovers a plot to assassinate all the attending world leaders.'),
(426, 426, 'The Curious Case of Benjamin Button', 'Drama,Fantasy,Romance', 'Tells the story of Benjamin Button, a man who starts aging backwards with bizarre consequences.'),
(427, 427, 'Sin City: A Dame to Kill For', 'Action,Crime,Thriller', 'Some of Sin City\'s most hard-boiled citizens cross paths with a few of its more reviled inhabitants.'),
(428, 428, 'The Bourne Ultimatum', 'Action,Mystery,Thriller', 'Jason Bourne dodges a ruthless CIA official and his agents from a new assassination program while searching for the origins of his life as a trained killer.'),
(429, 429, 'Srpski film', 'Horror,Mystery,Thriller', 'An aging porn star agrees to participate in an \"art film\" in order to make a clean break from the business, only to discover that he has been drafted into making a pedophilia and necrophilia themed snuff film.'),
(430, 430, 'The Purge: Election Year', 'Action,Horror,Sci-Fi', 'Former Police Sergeant Barnes becomes head of security for Senator Charlie Roan, a Presidential candidate targeted for death on Purge night due to her vow to eliminate the Purge.'),
(431, 431, '3 Idiots', 'Comedy,Drama', 'Two friends are searching for their long lost companion. They revisit their college days and recall the memories of their friend who inspired them to think differently, even as the rest of the world called them \"idiots\".'),
(432, 432, 'Zoolander 2', 'Comedy', 'Derek and Hansel are lured into modeling again, in Rome, where they find themselves the target of a sinister conspiracy.'),
(433, 433, 'World War Z', 'Action,Adventure,Horror', 'Former United Nations employee Gerry Lane traverses the world in a race against time to stop the Zombie pandemic that is toppling armies and governments, and threatening to destroy humanity itself.'),
(434, 434, 'Mission: Impossible - Ghost Protocol', 'Action,Adventure,Thriller', 'The IMF is shut down when it\'s implicated in the bombing of the Kremlin, causing Ethan Hunt and his new team to go rogue to clear their organization\'s name.'),
(435, 435, 'Let Me Make You a Martyr', 'Action,Crime,Drama', 'A cerebral revenge film about two adopted siblings who fall in love, and hatch a plan to kill their abusive father.'),
(436, 436, 'Filth', 'Comedy,Crime,Drama', 'A corrupt, junkie cop with bipolar disorder attempts to manipulate his way through a promotion in order to win back his wife and daughter while also fighting his own borderline-fueled inner demons.'),
(437, 437, 'The Longest Ride', 'Drama,Romance', 'The lives of a young couple intertwine with a much older man, as he reflects back on a past love.'),
(438, 438, 'The imposible', 'Drama,Thriller', 'The story of a tourist family in Thailand caught in the destruction and chaotic aftermath of the 2004 Indian Ocean tsunami.'),
(439, 439, 'Kick-Ass 2', 'Action,Comedy,Crime', 'Following Kick-Ass\' heroics, other citizens are inspired to become masked crusaders. But the Red Mist leads his own group of evil supervillains to kill Kick-Ass and destroy everything for which he stands.'),
(440, 440, 'Folk Hero & Funny Guy', 'Comedy', 'A successful singer-songwriter hatches a plan to help his friend\'s struggling comedy career and broken love life by hiring him as his opening act on his solo tour.'),
(441, 441, 'Oz the Great and Powerful', 'Adventure,Family,Fantasy', 'A frustrated circus magician from Kansas is transported to a magical land called Oz, where he will have to fulfill a prophecy to become the king, and release the land from the Wicked Witches using his great (but fake) powers.'),
(442, 442, 'Brooklyn', 'Drama,Romance', 'An Irish immigrant lands in 1950s Brooklyn, where she quickly falls into a romance with a local. When her past catches up with her, however, she must choose between two countries and the lives that exist within.'),
(443, 443, 'Coraline', 'Animation,Family,Fantasy', 'An adventurous girl finds another world that is a strangely idealized version of her frustrating home, but it has sinister secrets.'),
(444, 444, 'Blue Valentine', 'Drama,Romance', 'The relationship of a contemporary married couple, charting their evolution over a span of years by cross-cutting between time periods.'),
(445, 445, 'The Thinning', 'Thriller', '\"The Thinning\" takes place in a post-apocalyptic future where population control is dictated by a high-school aptitude test. When two students (Logan Paul and Peyton List) discover the test... See full summary ?'),
(446, 446, 'Silent Hill', 'Adventure,Horror,Mystery', 'A woman, Rose, goes in search for her adopted daughter within the confines of a strange, desolate town called Silent Hill.'),
(447, 447, 'Dredd', 'Action,Sci-Fi', 'In a violent, futuristic city where the police have the authority to act as judge, jury and executioner, a cop teams with a trainee to take down a gang that deals the reality-altering drug, SLO-MO.'),
(448, 448, 'Hunt for the Wilderpeople', 'Adventure,Comedy,Drama', 'A national manhunt is ordered for a rebellious kid and his foster uncle who go missing in the wild New Zealand bush.'),
(449, 449, 'Big Hero 6', 'Animation,Action,Adventure', 'The special bond that develops between plus-sized inflatable robot Baymax, and prodigy Hiro Hamada, who team up with a group of friends to form a band of high-tech heroes.'),
(450, 450, 'Carrie', 'Drama,Horror', 'A shy girl, outcasted by her peers and sheltered by her religious mother, unleashes telekinetic terror on her small town after being pushed too far at her senior prom.'),
(451, 451, 'Iron Man 2', 'Action,Adventure,Sci-Fi', 'With the world now aware of his identity as Iron Man, Tony Stark must contend with both his declining health and a vengeful mad man with ties to his father\'s legacy.');
INSERT INTO `movie` (`movie_id`, `Rank`, `Title`, `Genre`, `Description`) VALUES
(452, 452, 'Demolition', 'Comedy,Drama', 'A successful investment banker struggles after losing his wife in a tragic car crash. With the help of a customer service rep and her young son, he starts to rebuild, beginning with the demolition of the life he once knew.'),
(453, 453, 'Pandorum', 'Action,Horror,Mystery', 'A pair of crew members aboard a spaceship wake up with no knowledge of their mission or their identities.'),
(454, 454, 'Olympus Has Fallen', 'Action,Thriller', 'Disgraced Secret Service agent (and former presidential guard) Mike Banning finds himself trapped inside the White House in the wake of a terrorist attack; using his inside knowledge, Banning works with national security to rescue the President from his kidnappers.'),
(455, 455, 'I Am Number Four', 'Action,Adventure,Sci-Fi', 'Aliens and their Guardians are hiding on Earth from intergalactic bounty hunters. They can only be killed in numerical order, and Number Four is next on the list. This is his story.'),
(456, 456, 'Jagten', 'Drama', 'A teacher lives a lonely life, all the while struggling over his son\'s custody. His life slowly gets better as he finds love and receives good news from his son, but his new luck is about to be brutally shattered by an innocent little lie.'),
(457, 457, 'The Proposal', 'Comedy,Drama,Romance', 'A pushy boss forces her young assistant to marry her in order to keep her visa status in the U.S. and avoid deportation to Canada.'),
(458, 458, 'Get Hard', 'Comedy,Crime', 'When millionaire James King is jailed for fraud and bound for San Quentin, he turns to Darnell Lewis to prep him to go behind bars.'),
(459, 459, 'Just Go with It', 'Comedy,Romance', 'On a weekend trip to Hawaii, a plastic surgeon convinces his loyal assistant to pose as his soon-to-be-divorced wife in order to cover up a careless lie he told to his much-younger girlfriend.'),
(460, 460, 'Revolutionary Road', 'Drama,Romance', 'A young couple living in a Connecticut suburb during the mid-1950s struggle to come to terms with their personal problems while trying to raise their two children.'),
