(599, 599, 'Moon', 'Drama,Mystery,Sci-Fi', 'Astronaut Sam Bell has a quintessentially personal encounter toward the end of his three-year stint on the Moon, where he, working alongside his computer, GERTY, sends back to Earth parcels of a resource that has helped diminish our planet\'s power problems.'),
(600, 600, 'Megamind', 'Animation,Action,Comedy', 'The supervillain Megamind finally defeats his nemesis, the superhero Metro Man. But without a hero, he loses all purpose and must find new meaning to his life.'),
(601, 601, 'Gangster Squad', 'Action,Crime,Drama', 'It\'s 1949 Los Angeles, the city is run by gangsters and a malicious mobster, Mickey Cohen. Determined to end the corruption, John O\'Mara assembles a team of cops, ready to take down the ruthless leader and restore peace to the city.'),
(602, 602, 'Blood Father', 'Action,Crime,Drama', 'An ex-con reunites with his estranged wayward 17-year old daughter to protect her from drug dealers who are trying to kill her.'),
(603, 603, 'He\'s Just Not That Into You', 'Comedy,Drama,Romance', 'The Baltimore-set movie of interconnecting story arcs deals with the challenges of reading or misreading human behavior.'),
(604, 604, 'Kung Fu Panda 3', 'Animation,Action,Adventure', 'Continuing his \"legendary adventures of awesomeness\", Po must face two hugely epic, but different threats: one supernatural and the other a little closer to his home.'),
(605, 605, 'The Rise of the Krays', 'Crime,Drama', 'Two brothers unleash a psychotic reign of terror on their journey to build an empire of unprecedented power in the British Mafia.'),
(606, 606, 'Handsome Devil', 'Drama', 'Ned and Conor are forced to share a bedroom at their boarding school. The loner and the star athlete at this rugby-mad school form an unlikely friendship until it\'s tested by the authorities.'),
(607, 607, 'Winter\'s Bone', 'Drama', 'An unflinching Ozark Mountain girl hacks through dangerous social terrain as she hunts down her drug-dealing father while trying to keep her family intact.'),
(608, 608, 'Horrible Bosses', 'Comedy,Crime', 'Three friends conspire to murder their awful bosses when they realize they are standing in the way of their happiness.'),
(609, 609, 'Mommy', 'Drama', 'A widowed single mother, raising her violent son alone, finds new hope when a mysterious neighbor inserts herself into their household.'),
(610, 610, 'Hellboy II: The Golden Army', 'Action,Adventure,Fantasy', 'The mythical world starts a rebellion against humanity in order to rule the Earth, so Hellboy and his team must save the world from the rebellious creatures.'),
(611, 611, 'Beautiful Creatures', 'Drama,Fantasy,Romance', 'Ethan longs to escape his small Southern town. He meets a mysterious new girl, Lena. Together, they uncover dark secrets about their respective families, their history and their town.'),
(612, 612, 'Toni Erdmann', 'Comedy,Drama', 'A practical joking father tries to reconnect with his hard working daughter by creating an outrageous alter ego and posing as her CEO\'s life coach.'),
(613, 613, 'The Lovely Bones', 'Drama,Fantasy,Thriller', 'Centers on a young girl who has been murdered and watches over her family - and her killer - from purgatory. She must weigh her desire for vengeance against her desire for her family to heal.'),
(614, 614, 'The Assassination of Jesse James by the Coward Robert Ford', 'Biography,Crime,Drama', 'Robert Ford, who\'s idolized Jesse James since childhood, tries hard to join the reforming gang of the Missouri outlaw, but gradually becomes resentful of the bandit leader.'),
(615, 615, 'Don Jon', 'Comedy,Drama,Romance', 'A New Jersey guy dedicated to his family, friends, and church, develops unrealistic expectations from watching porn and works to find happiness and intimacy with his potential true love.'),
(616, 616, 'Bastille Day', 'Action,Crime,Drama', 'A young con artist and an unruly CIA agent embark on an anti-terrorist mission in France.'),
(617, 617, '2307: Winter\'s Dream', 'Sci-Fi', 'In 2307, a future soldier is sent on a mission to hunt down the leader of the humanoid rebellion.'),
(618, 618, 'Free State of Jones', 'Action,Biography,Drama', 'A disillusioned Confederate army deserter returns to Mississippi and leads a militia of fellow deserters, runaway slaves, and women in an uprising against the corrupt local Confederate government.'),
(619, 619, 'Mr. Right', 'Action,Comedy,Romance', 'A girl falls for the \"perfect\" guy, who happens to have a very fatal flaw: he\'s a hitman on the run from the crime cartels who employ him.'),
(620, 620, 'The Secret Life of Walter Mitty', 'Adventure,Comedy,Drama', 'When his job along with that of his co-worker are threatened, Walter takes action in the real world embarking on a global journey that turns into an adventure more extraordinary than anything he could have ever imagined.'),
(621, 621, 'Dope', 'Comedy,Crime,Drama', 'Life changes for Malcolm, a geek who\'s surviving life in a tough neighborhood, after a chance invitation to an underground party leads him and his friends into a Los Angeles adventure.'),
(622, 622, 'Underworld Awakening', 'Action,Fantasy,Horror', 'When human forces discover the existence of the Vampire and Lycan clans, a war to eradicate both species commences. The vampire warrior Selene leads the battle against humankind.'),
(623, 623, 'Antichrist', 'Drama,Horror', 'A grieving couple retreat to their cabin in the woods, hoping to repair their broken hearts and troubled marriage. But nature takes its course and things go from bad to worse.'),
(624, 624, 'Friday the 13th', 'Horror', 'A group of young adults discover a boarded up Camp Crystal Lake, where they soon encounter Jason Voorhees and his deadly intentions.'),
(625, 625, 'Taken 3', 'Action,Thriller', 'Ex-government operative Bryan Mills is accused of a ruthless murder he never committed or witnessed. As he is tracked and pursued, Mills brings out his particular set of skills to find the true killer and clear his name.'),
(626, 626, 'Total Recall', 'Action,Adventure,Mystery', 'A factory worker, Douglas Quaid, begins to suspect that he is a spy after visiting Rekall - a company that provides its clients with implanted fake memories of a life they would like to have led - goes wrong and he finds himself on the run.'),
(627, 627, 'X-Men: The Last Stand', 'Action,Adventure,Fantasy', 'When a cure is found to treat mutations, lines are drawn amongst the X-Men, led by Professor Charles Xavier, and the Brotherhood, a band of powerful mutants organized under Xavier\'s former ally, Magneto.'),
(628, 628, 'The Escort', 'Comedy,Drama,Romance', 'Desperate for a good story, a sex-addicted journalist throws himself into the world of high-class escorts when he starts following a Stanford-educated prostitute.'),
(629, 629, 'The Whole Truth', 'Crime,Drama,Mystery', 'A defense attorney works to get his teenage client acquitted of murdering his wealthy father.'),
(630, 630, 'Night at the Museum: Secret of the Tomb', 'Adventure,Comedy,Family', 'Larry spans the globe, uniting favorite and new characters while embarking on an epic quest to save the magic before it is gone forever.'),
(631, 631, 'Love & Other Drugs', 'Comedy,Drama,Romance', 'A young woman suffering from Parkinson\'s befriends a drug rep working for Pfizer in 1990s Pittsburgh.'),
(632, 632, 'The Interview', 'Comedy', 'Dave Skylark and his producer Aaron Rapoport run the celebrity tabloid show \"Skylark Tonight\". When they land an interview with a surprise fan, North Korean dictator Kim Jong-un, they are recruited by the CIA to turn their trip to Pyongyang into an assassination mission.'),
(633, 633, 'The Host', 'Comedy,Drama,Horror', 'A monster emerges from Seoul\'s Han River and focuses its attention on attacking people. One victim\'s loving family does what it can to rescue her from its clutches.'),
(634, 634, 'Megan Is Missing', 'Drama,Horror,Thriller', 'Two teenage girls encounter an Internet child predator.'),
(635, 635, 'WALLE', 'Animation,Adventure,Family', 'In the distant future, a small waste-collecting robot inadvertently embarks on a space journey that will ultimately decide the fate of mankind.'),
(636, 636, 'Knocked Up', 'Comedy,Romance', 'For fun-loving party animal Ben Stone, the last thing he ever expected was for his one-night stand to show up on his doorstep eight weeks later to tell him she\'s pregnant with his child.'),
(637, 637, 'Source Code', 'Mystery,Romance,Sci-Fi', 'A soldier wakes up in someone else\'s body and discovers he\'s part of an experimental government program to find the bomber of a commuter train. A mission he has only 8 minutes to complete.'),
(638, 638, 'Lawless', 'Crime,Drama', 'Set in Depression-era Franklin County, Virginia, a trio of bootlegging brothers are threatened by a new special deputy and other authorities angling for a cut of their profits.'),
(639, 639, 'Unfriended', 'Drama,Horror,Mystery', 'A group of online chat room friends find themselves haunted by a mysterious, supernatural force using the account of their dead friend.'),
(640, 640, 'American Reunion', 'Comedy', 'Jim, Michelle, Stifler, and their friends reunite in East Great Falls, Michigan for their high school reunion.'),
(641, 641, 'The Pursuit of Happyness', 'Biography,Drama', 'A struggling salesman takes custody of his son as he\'s poised to begin a life-changing professional career.'),
(642, 642, 'Relatos salvajes', 'Comedy,Drama,Thriller', 'Six short stories that explore the extremities of human behavior involving people in distress.'),
(643, 643, 'The Ridiculous 6', 'Comedy,Western', 'An outlaw who was raised by Native Americans discovers that he has five half-brothers; together the men go on a mission to find their wayward, deadbeat dad.'),
(644, 644, 'Frantz', 'Drama,History,War', 'In the aftermath of WWI, a young German who grieves the death of her fianc in France meets a mysterious Frenchman who visits the fianc\'s grave to lay flowers.'),
(645, 645, 'Viral', 'Drama,Horror,Sci-Fi', 'Following the outbreak of a virus that wipes out the majority of the human population, a young woman documents her family\'s new life in quarantine and tries to protect her infected sister.'),
(646, 646, 'Gran Torino', 'Drama', 'Disgruntled Korean War veteran Walt Kowalski sets out to reform his neighbor, a Hmong teenager who tried to steal Kowalski\'s prized possession: a 1972 Gran Torino.'),
(647, 647, 'Burnt', 'Comedy,Drama', 'Adam Jones (Bradley Cooper) is a chef who destroyed his career with drugs and diva behavior. He cleans up and returns to London, determined to redeem himself by spearheading a top restaurant that can gain three Michelin stars.'),
(648, 648, 'Tall Men', 'Fantasy,Horror,Thriller', 'A challenged man is stalked by tall phantoms in business suits after he purchases a car with a mysterious black credit card.'),
(649, 649, 'Sleeping Beauty', 'Drama,Romance', 'A haunting portrait of Lucy, a young university student drawn into a mysterious hidden world of unspoken desires.'),
(650, 650, 'Vampire Academy', 'Action,Comedy,Fantasy', 'Rose Hathaway is a Dhampir, half human-half vampire, a guardian of the Moroi, peaceful, mortal vampires living discreetly within our world. Her calling is to protect the Moroi from bloodthirsty, immortal Vampires, the Strigoi.'),
(651, 651, 'Sweeney Todd: The Demon Barber of Fleet Street', 'Drama,Horror,Musical', 'The infamous story of Benjamin Barker, a.k.a. Sweeney Todd, who sets up a barber shop down in London which is the basis for a sinister partnership with his fellow tenant, Mrs. Lovett. Based on the hit Broadway musical.'),
(652, 652, 'Solace', 'Crime,Drama,Mystery', 'A psychic works with the FBI in order to hunt down a serial killer.'),
(653, 653, 'Insidious', 'Horror,Mystery,Thriller', 'A family looks to prevent evil spirits from trapping their comatose child in a realm called The Further.'),
(654, 654, 'Popstar: Never Stop Never Stopping', 'Comedy,Music', 'When it becomes clear that his solo album is a failure, a former boy band member does everything in his power to maintain his celebrity status.'),
(655, 655, 'The Levelling', 'Drama', 'Somerset, October 2014. When Clover Catto (Ellie Kendrick) receives a call telling her that her younger brother Harry (Joe Blakemore) is dead, she must return to her family farm and face ... See full summary ?'),
(656, 656, 'Public Enemies', 'Biography,Crime,Drama', 'The Feds try to take down notorious American gangsters John Dillinger, Baby Face Nelson and Pretty Boy Floyd during a booming crime wave in the 1930s.'),
(657, 657, 'Boyhood', 'Drama', 'The life of Mason, from early childhood to his arrival at college.'),
(658, 658, 'Teenage Mutant Ninja Turtles', 'Action,Adventure,Comedy', 'When a kingpin threatens New York City, a group of mutated turtle warriors must emerge from the shadows to protect their home.'),
(659, 659, 'Eastern Promises', 'Crime,Drama,Mystery', 'A Russian teenager living in London who dies during childbirth leaves clues to a midwife in her journal that could tie her child to a rape involving a violent Russian mob family.'),
(660, 660, 'The Daughter', 'Drama', 'The story follows a man who returns home to discover a long-buried family secret, and whose attempts to put things right threaten the lives of those he left home years before.'),
(661, 661, 'Pineapple Express', 'Action,Comedy,Crime', 'A process server and his marijuana dealer wind up on the run from hitmen and a corrupt police officer after he witnesses his dealer\'s boss murder a competitor while trying to serve papers on him.'),
(662, 662, 'The First Time', 'Comedy,Drama,Romance', 'A shy senior and a down-to-earth junior fall in love over one weekend.'),
(663, 663, 'Gone Baby Gone', 'Crime,Drama,Mystery', 'Two Boston area detectives investigate a little girl\'s kidnapping, which ultimately turns into a crisis both professionally and personally.'),
(664, 664, 'The Heat', 'Action,Comedy,Crime', 'An uptight FBI Special Agent is paired with a foul-mouthed Boston cop to take down a ruthless drug lord.'),
(665, 665, 'L\'avenir', 'Drama', 'A philosophy teacher soldiers through the death of her mother, getting fired from her job, and dealing with a husband who is cheating on her.'),
(666, 666, 'Anna Karenina', 'Drama,Romance', 'In late-19th-century Russian high society, St. Petersburg aristocrat Anna Karenina enters into a life-changing affair with the dashing Count Alexei Vronsky.'),
(667, 667, 'Regression', 'Crime,Drama,Mystery', 'A detective and a psychoanalyst uncover evidence of a satanic cult while investigating the rape of a young woman.'),
(668, 668, 'Ted 2', 'Adventure,Comedy,Romance', 'Newlywed couple Ted and Tami-Lynn want to have a baby, but in order to qualify to be a parent, Ted will have to prove he\'s a person in a court of law.'),
(669, 669, 'Pain & Gain', 'Comedy,Crime,Drama', 'A trio of bodybuilders in Florida get caught up in an extortion ring and a kidnapping scheme that goes terribly wrong.'),
(670, 670, 'Blood Diamond', 'Adventure,Drama,Thriller', 'A fisherman, a smuggler, and a syndicate of businessmen match wits over the possession of a priceless diamond.'),
(671, 671, 'Devil\'s Knot', 'Biography,Crime,Drama', 'The savage murders of three young children sparks a controversial trial of three teenagers accused of killing the kids as part of a satanic ritual.'),
(672, 672, 'Child 44', 'Crime,Drama,Thriller', 'A disgraced member of the Russian military police investigates a series of child murders during the Stalin-era Soviet Union.'),
(673, 673, 'The Hurt Locker', 'Drama,History,Thriller', 'During the Iraq War, a Sergeant recently assigned to an army bomb squad is put at odds with his squad mates due to his maverick way of handling his work.'),
(674, 674, 'Green Lantern', 'Action,Adventure,Sci-Fi', 'Reckless test pilot Hal Jordan is granted an alien ring that bestows him with otherworldly powers that inducts him into an intergalactic police force, the Green Lantern Corps.'),
(675, 675, 'War on Everyone', 'Action,Comedy', 'Two corrupt cops set out to blackmail and frame every criminal unfortunate enough to cross their path. Events, however, are complicated by the arrival of someone who appears to be even more dangerous than they are.'),
(676, 676, 'The Mist', 'Horror', 'A freak storm unleashes a species of bloodthirsty creatures on a small town, where a small band of citizens hole up in a supermarket and fight for their lives.'),
(677, 677, 'Escape Plan', 'Action,Crime,Mystery', 'When a structural-security authority finds himself set up and incarcerated in the world\'s most secret and secure prison, he has to use his skills to escape with help from the inside.'),
(678, 678, 'Love, Rosie', 'Comedy,Romance', 'Rosie and Alex have been best friends since they were 5, so they couldn\'t possibly be right for one another...or could they? When it comes to love, life and making the right choices, these two are their own worst enemies.'),
(679, 679, 'The DUFF', 'Comedy', 'A high school senior instigates a social pecking order revolution after finding out that she has been labeled the DUFF - Designated Ugly Fat Friend - by her prettier, more popular counterparts.'),
(680, 680, 'The Age of Shadows', 'Action,Drama,Thriller', 'Japanese agents close in as members of the Korean resistance plan an attack in 1920\'s Seoul.'),
(681, 681, 'The Hunger Games: Mockingjay - Part 1', 'Action,Adventure,Sci-Fi', 'Katniss Everdeen is in District 13 after she shatters the games forever. Under the leadership of President Coin and the advice of her trusted friends, Katniss spreads her wings as she fights to save Peeta and a nation moved by her courage.'),
(682, 682, 'We Need to Talk About Kevin', 'Drama,Mystery,Thriller', 'Kevin\'s mother struggles to love her strange child, despite the increasingly vicious things he says and does as he grows up. But Kevin is just getting started, and his final act will be beyond anything anyone imagined.'),
(683, 683, 'Love & Friendship', 'Comedy,Drama,Romance', 'Lady Susan Vernon takes up temporary residence at her in-laws\' estate and, while there, is determined to be a matchmaker for her daughter Frederica -- and herself too, naturally.');
INSERT INTO `movie` (`movie_id`, `Rank`, `Title`, `Genre`, `Description`) VALUES
(684, 684, 'The Mortal Instruments: City of Bones', 'Action,Fantasy,Horror', 'When her mother disappears, Clary Fray learns that she descends from a line of warriors who protect our world from demons. She joins forces with others like her and heads into a dangerous alternate New York called the Shadow World.'),
(685, 685, 'Seven Pounds', 'Drama,Romance', 'A man with a fateful secret embarks on an extraordinary journey of redemption by forever changing the lives of seven strangers.'),
(686, 686, 'The King\'s Speech', 'Biography,Drama', 'The story of King George VI of the United Kingdom of Great Britain and Northern Ireland, his impromptu ascension to the throne and the speech therapist who helped the unsure monarch become worthy of it.'),
(687, 687, 'Hunger', 'Biography,Drama', 'Irish republican Bobby Sands leads the inmates of a Northern Irish prison in a hunger strike.'),
(688, 688, 'Jumper', 'Action,Adventure,Sci-Fi', 'A teenager with teleportation abilities suddenly finds himself in the middle of an ancient war between those like him and their sworn annihilators.'),
(689, 689, 'Toy Story 3', 'Animation,Adventure,Comedy', 'The toys are mistakenly delivered to a day-care center instead of the attic right before Andy leaves for college, and it\'s up to Woody to convince the other toys that they weren\'t abandoned and to return home.'),
(690, 690, 'Tinker Tailor Soldier Spy', 'Drama,Mystery,Thriller', 'In the bleak days of the Cold War, espionage veteran George Smiley is forced from semi-retirement to uncover a Soviet agent within MI6.'),
(691, 691, 'Resident Evil: Retribution', 'Action,Horror,Sci-Fi', 'Alice fights alongside a resistance movement to regain her freedom from an Umbrella Corporation testing facility.'),
(692, 692, 'Dear Zindagi', 'Drama,Romance', 'Kaira is a budding cinematographer in search of a perfect life. Her encounter with Jug, an unconventional thinker, helps her gain a new perspective on life. She discovers that happiness is all about finding comfort in life\'s imperfections.'),
(693, 693, 'Genius', 'Biography,Drama', 'A chronicle of Max Perkins\'s time as the book editor at Scribner, where he oversaw works by Thomas Wolfe, Ernest Hemingway, F. Scott Fitzgerald and others.'),
(694, 694, 'Pompeii', 'Action,Adventure,Drama', 'A slave-turned-gladiator finds himself in a race against time to save his true love, who has been betrothed to a corrupt Roman Senator. As Mount Vesuvius erupts, he must fight to save his beloved as Pompeii crumbles around him.'),
(695, 695, 'Life of Pi', 'Adventure,Drama,Fantasy', 'A young man who survives a disaster at sea is hurtled into an epic journey of adventure and discovery. While cast away, he forms an unexpected connection with another survivor: a fearsome Bengal tiger.'),
(696, 696, 'Hachi: A Dog\'s Tale', 'Drama,Family', 'A college professor\'s bond with the abandoned dog he takes into his home.'),
(697, 697, '10 Years', 'Comedy,Drama,Romance', 'The night before their high school reunion, a group of friends realize they still haven\'t quite grown up in some ways.'),
(698, 698, 'I Origins', 'Drama,Romance,Sci-Fi', 'A molecular biologist and his laboratory partner uncover evidence that may fundamentally change society as we know it.'),
(699, 699, 'Live Free or Die Hard', 'Action,Adventure,Thriller', 'John McClane and a young hacker join forces to take down master cyber-terrorist Thomas Gabriel in Washington D.C.'),
(700, 700, 'The Matchbreaker', 'Comedy,Romance', 'When an idealistic romantic gets fired from his day job, he is offered a \"one-time gig\" to break up a girl\'s relationship for her disapproving parents. This \"one-time\" gig spreads through ... See full summary ?'),
(701, 701, 'Funny Games', 'Crime,Drama,Horror', 'Two psychopathic young men take a family hostage in their cabin.'),
(702, 702, 'Ted', 'Comedy,Fantasy', 'John Bennett, a man whose childhood wish of bringing his teddy bear to life came true, now must decide between keeping the relationship with the bear or his girlfriend, Lori.'),
(703, 703, 'RED', 'Action,Comedy,Crime', 'When his peaceful life is threatened by a high-tech assassin, former black-ops agent Frank Moses reassembles his old team in a last ditch effort to survive and uncover his assailants.'),
(704, 704, 'Australia', 'Adventure,Drama,Romance', 'Set in northern Australia before World War II, an English aristocrat who inherits a sprawling ranch reluctantly pacts with a stock-man in order to protect her new property from a takeover plot. As the pair drive 2,000 head of cattle over unforgiving landscape, they experience the bombing of Darwin, Australia, by Japanese forces firsthand.'),
(705, 705, 'Faster', 'Action,Crime,Drama', 'An ex-con gets on a series of apparently unrelated killings. He gets tracked by a veteran cop with secrets of his own and an egocentric hit man.'),
(706, 706, 'The Neighbor', 'Crime,Horror,Thriller', 'Set in Cutter Mississippi, the film follows a man who discovers the dark truth about his neighbor and the secrets he may be keeping in the cellar.'),
(707, 707, 'The Adjustment Bureau', 'Romance,Sci-Fi,Thriller', 'The affair between a politician and a contemporary dancer is affected by mysterious forces keeping the lovers apart.'),
(708, 708, 'The Hollars', 'Comedy,Drama,Romance', 'A man returns to his small hometown after learning that his mother has fallen ill and is about to undergo surgery.'),
(709, 709, 'The Judge', 'Crime,Drama', 'Big-city lawyer Hank Palmer returns to his childhood home where his father, the town\'s judge, is suspected of murder. Hank sets out to discover the truth and, along the way, reconnects with his estranged family.'),
(710, 710, 'Closed Circuit', 'Crime,Drama,Mystery', 'A high-profile terrorism case unexpectedly binds together two ex-lovers on the defense team - testing the limits of their loyalties and placing their lives in jeopardy.'),
(711, 711, 'Transformers: Revenge of the Fallen', 'Action,Adventure,Sci-Fi', 'Sam Witwicky leaves the Autobots behind for a normal life. But when his mind is filled with cryptic symbols, the Decepticons target him and he is dragged back into the Transformers\' war.'),
(712, 712, 'La tortue rouge', 'Animation,Fantasy', 'A man is shipwrecked on a deserted island and encounters a red turtle, which changes his life.'),
(713, 713, 'The Book of Life', 'Animation,Adventure,Comedy', 'Manolo, a young man who is torn between fulfilling the expectations of his family and following his heart, embarks on an adventure that spans three fantastic worlds where he must face his greatest fears.'),
(714, 714, 'Incendies', 'Drama,Mystery,War', 'Twins journey to the Middle East to discover their family history, and fulfill their mother\'s last wishes.'),
(715, 715, 'The Heartbreak Kid', 'Comedy,Romance', 'A newly wed man who believes he\'s just gotten hitched to the perfect woman encounters another lady on his honeymoon.'),
(716, 716, 'Happy Feet', 'Animation,Comedy,Family', 'Into the world of the Emperor Penguins, who find their soul mates through song, a penguin is born who cannot sing. But he can tap dance something fierce!'),
(717, 717, 'Entourage', 'Comedy', 'Movie star Vincent Chase, together with his boys Eric, Turtle, and Johnny, are back - and back in business with super agent-turned-studio head Ari Gold on a risky project that will serve as Vince\'s directorial debut.'),
(718, 718, 'The Strangers', 'Horror,Mystery,Thriller', 'A young couple staying in an isolated vacation home are terrorized by three unknown assailants.'),
(719, 719, 'Noah', 'Action,Adventure,Drama', 'A man is chosen by his world\'s creator to undertake a momentous mission before an apocalyptic flood cleanses the world.'),
(720, 720, 'Neighbors', 'Comedy', 'After they are forced to live next to a fraternity house, a couple with a newborn baby do whatever they can to take them down.'),
(721, 721, 'Nymphomaniac: Vol. II', 'Drama', 'The continuation of Joe\'s sexually dictated life delves into the darker aspects of her adulthood, obsessions and what led to her being in Seligman\'s care.'),
(722, 722, 'Wild', 'Adventure,Biography,Drama', 'A chronicle of one woman\'s 1,100-mile solo hike undertaken as a way to recover from a recent personal tragedy.'),
(723, 723, 'Grown Ups', 'Comedy', 'After their high school basketball coach passes away, five good friends and former teammates reunite for a Fourth of July holiday weekend.'),
(724, 724, 'Blair Witch', 'Horror,Thriller', 'After discovering a video showing what he believes to be his vanished sister Heather, James and a group of friends head to the forest believed to be inhabited by the Blair Witch.'),
(725, 725, 'The Karate Kid', 'Action,Drama,Family', 'Work causes a single mother to move to China with her young son; in his new home, the boy embraces kung fu, taught to him by a master.'),
(726, 726, 'Dark Shadows', 'Comedy,Fantasy,Horror', 'An imprisoned vampire, Barnabas Collins, is set free and returns to his ancestral home, where his dysfunctional descendants are in need of his protection.'),
(727, 727, 'Friends with Benefits', 'Comedy,Romance', 'A young man and woman decide to take their friendship to the next level without becoming a couple, but soon discover that adding sex only leads to complications.'),
(728, 728, 'The Illusionist', 'Drama,Mystery,Romance', 'In turn-of-the-century Vienna, a magician uses his abilities to secure the love of a woman far above his social standing.'),
(729, 729, 'The A-Team', 'Action,Adventure,Comedy', 'A group of Iraq War veterans looks to clear their name with the U.S. military, who suspect the four men of committing a crime for which they were framed.'),
(730, 730, 'The Guest', 'Thriller', 'A soldier introduces himself to the Peterson family, claiming to be a friend of their son who died in action. After the young man is welcomed into their home, a series of accidental deaths seem to be connected to his presence.'),
(731, 731, 'The Internship', 'Comedy', 'Two salesmen whose careers have been torpedoed by the digital age find their way into a coveted internship at Google, where they must compete with a group of young, tech-savvy geniuses for a shot at employment.'),
(732, 732, 'Paul', 'Adventure,Comedy,Sci-Fi', 'Two British comic-book geeks traveling across the U.S. encounter an alien outside Area 51.'),
(733, 733, 'This Beautiful Fantastic', 'Comedy,Drama,Fantasy', 'A young woman who dreams of being a children\'s author makes an unlikely friendship with a cantankerous, rich old widower.'),
(734, 734, 'The Da Vinci Code', 'Mystery,Thriller', 'A murder inside the Louvre and clues in Da Vinci paintings lead to the discovery of a religious mystery protected by a secret society for two thousand years -- which could shake the foundations of Christianity.'),
(735, 735, 'Mr. Church', 'Comedy,Drama', '\"Mr. Church\" tells the story of a unique friendship that develops when a little girl and her dying mother retain the services of a talented cook - Henry Joseph Church. What begins as a six month arrangement instead spans into fifteen years and creates a family bond that lasts forever.'),
