(874, 874, 'One Day', 'Drama,Romance', 'After spending the night together on the night of their college graduation Dexter and Em are shown each year on the same date to see where they are in their lives. They are sometimes together, sometimes not, on that day.'),
(875, 875, 'Life as We Know It', 'Comedy,Drama,Romance', 'Two single adults become caregivers to an orphaned girl when their mutual best friends die in an accident.'),
(876, 876, '28 Weeks Later', 'Drama,Horror,Sci-Fi', 'Six months after the rage virus was inflicted on the population of Great Britain, the US Army helps to secure a small area of London for the survivors to repopulate and start again. But not everything goes to plan.'),
(877, 877, 'Warm Bodies', 'Comedy,Horror,Romance', 'After a highly unusual zombie saves a still-living girl from an attack, the two form a relationship that sets in motion events that might transform the entire lifeless world.'),
(878, 878, 'Blue Jasmine', 'Drama', 'A New York socialite, deeply troubled and in denial, arrives in San Francisco to impose upon her sister. She looks a million, but isn\'t bringing money, peace, or love...'),
(879, 879, 'G.I. Joe: Retaliation', 'Action,Adventure,Sci-Fi', 'The G.I. Joes are not only fighting their mortal enemy Cobra; they are forced to contend with threats from within the government that jeopardize their very existence.'),
(880, 880, 'Wrath of the Titans', 'Action,Adventure,Fantasy', 'Perseus braves the treacherous underworld to rescue his father, Zeus, captured by his son, Ares, and brother Hades who unleash the ancient Titans upon the world.'),
(881, 881, 'Shin Gojira', 'Action,Adventure,Drama', 'Japan is plunged into chaos upon the appearance of a giant monster.'),
(882, 882, 'Saving Mr. Banks', 'Biography,Comedy,Drama', 'Author P.L. Travers reflects on her childhood after reluctantly meeting with Walt Disney, who seeks to adapt her Mary Poppins books for the big screen.'),
(883, 883, 'Transcendence', 'Drama,Mystery,Romance', 'A scientist\'s drive for artificial intelligence, takes on dangerous implications when his consciousness is uploaded into one such program.'),
(884, 884, 'Rio', 'Animation,Adventure,Comedy', 'When Blu, a domesticated macaw from small-town Minnesota, meets the fiercely independent Jewel, he takes off on an adventure to Rio de Janeiro with the bird of his dreams.'),
(885, 885, 'Equals', 'Drama,Romance,Sci-Fi', 'In an emotionless utopia, two people fall in love when they regain their feelings from a mysterious disease, causing tensions between them and their society.'),
(886, 886, 'Babel', 'Drama', 'Tragedy strikes a married couple on vacation in the Moroccan desert, touching off an interlocking story involving four different families.'),
(887, 887, 'The Tree of Life', 'Drama,Fantasy', 'The story of a family in Waco, Texas in 1956. The eldest son witnesses the loss of innocence and struggles with his parents\' conflicting teachings.'),
(888, 888, 'The Lucky One', 'Drama,Romance', 'A Marine travels to Louisiana after serving three tours in Iraq and searches for the unknown woman he believes was his good luck charm during the war.'),
(889, 889, 'Piranha 3D', 'Comedy,Horror,Thriller', 'After a sudden underwater tremor sets free scores of the prehistoric man-eating fish, an unlikely group of strangers must band together to stop themselves from becoming fish food for the area\'s new razor-toothed residents.'),
(890, 890, '50/50', 'Comedy,Drama,Romance', 'Inspired by a true story, a comedy centered on a 27-year-old guy who learns of his cancer diagnosis, and his subsequent struggle to beat the disease.'),
(891, 891, 'The Intent', 'Crime,Drama', 'Gunz (Dylan Duffus) is thrust into a world of excitement when he joins the TIC crew. The crew, led by the ruthless Hoodz (Scorcher), goes from low level weed peddling to full on armed ... See full summary ?'),
(892, 892, 'This Is 40', 'Comedy,Romance', 'Pete and Debbie are both about to turn 40, their kids hate each other, both of their businesses are failing, they\'re on the verge of losing their house, and their relationship is threatening to fall apart.'),
(893, 893, 'Real Steel', 'Action,Drama,Family', 'In the near future, robot boxing is a top sport. A struggling promoter feels he\'s found a champion in a discarded robot.'),
(894, 894, 'Sex and the City', 'Comedy,Drama,Romance', 'A New York writer on sex and love is finally getting married to her Mr. Big. But her three best girlfriends must console her after one of them inadvertently leads Mr. Big to jilt her.'),
(895, 895, 'Rambo', 'Action,Thriller,War', 'In Thailand, John Rambo joins a group of missionaries to venture into war-torn Burma, and rescue a group of Christian aid workers who were kidnapped by the ruthless local infantry unit.'),
(896, 896, 'Planet Terror', 'Action,Comedy,Horror', 'After an experimental bio-weapon is released, turning thousands into zombie-like creatures, it\'s up to a rag-tag group of survivors to stop the infected and those behind its release.'),
(897, 897, 'Concussion', 'Biography,Drama,Sport', 'In Pittsburgh, accomplished pathologist Dr. Bennet Omalu uncovers the truth about brain damage in football players who suffer repeated concussions in the course of normal play.'),
(898, 898, 'The Fall', 'Adventure,Comedy,Drama', 'In a hospital on the outskirts of 1920s Los Angeles, an injured stuntman begins to tell a fellow patient, a little girl with a broken arm, a fantastic story of five mythical heroes. Thanks to his fractured state of mind and her vivid imagination, the line between fiction and reality blurs as the tale advances.'),
(899, 899, 'The Ugly Truth', 'Comedy,Romance', 'A romantically challenged morning show producer is reluctantly embroiled in a series of outrageous tests by her chauvinistic correspondent to prove his theories on relationships and help ... See full summary ?'),
(900, 900, 'Bride Wars', 'Comedy,Romance', 'Two best friends become rivals when they schedule their respective weddings on the same day.'),
(901, 901, 'Sleeping with Other People', 'Comedy,Drama,Romance', 'A good-natured womanizer and a serial cheater form a platonic relationship that helps reform them in ways, while a mutual attraction sets in.'),
(902, 902, 'Snakes on a Plane', 'Action,Adventure,Crime', 'An FBI agent takes on a plane full of deadly and venomous snakes, deliberately released to kill a witness being flown from Honolulu to Los Angeles to testify against a mob boss.'),
(903, 903, 'What If', 'Comedy,Romance', 'Wallace, who is burned out from a string of failed relationships, forms an instant bond with Chantry, who lives with her longtime boyfriend. Together, they puzzle out what it means if your best friend is also the love of your life.'),
(904, 904, 'How to Train Your Dragon 2', 'Animation,Action,Adventure', 'When Hiccup and Toothless discover an ice cave that is home to hundreds of new wild dragons and the mysterious Dragon Rider, the two friends find themselves at the center of a battle to protect the peace.'),
(905, 905, 'RoboCop', 'Action,Crime,Sci-Fi', 'In 2028 Detroit, when Alex Murphy - a loving husband, father and good cop - is critically injured in the line of duty, the multinational conglomerate OmniCorp sees their chance for a part-man, part-robot police officer.'),
(906, 906, 'In Dubious Battle', 'Drama', 'An activist gets caught up in the labor movement for farm workers in California during the 1930s.'),
(907, 907, 'Hello, My Name Is Doris', 'Comedy,Drama,Romance', 'A self-help seminar inspires a sixty-something woman to romantically pursue her younger co-worker.'),
(908, 908, 'Ocean\'s Thirteen', 'Crime,Thriller', 'Danny Ocean rounds up the boys for a third heist, after casino owner Willy Bank double-crosses one of the original eleven, Reuben Tishkoff.'),
(909, 909, 'Slither', 'Comedy,Horror,Sci-Fi', 'A small town is taken over by an alien plague, turning residents into zombies and all forms of mutant monsters.'),
(910, 910, 'Contagion', 'Drama,Thriller', 'Healthcare professionals, government officials and everyday people find themselves in the midst of a worldwide epidemic as the CDC works to find a cure.'),
(911, 911, 'Il racconto dei racconti - Tale of Tales', 'Drama,Fantasy,Horror', 'From the bitter quest of the Queen of Longtrellis, to two mysterious sisters who provoke the passion of a king, to the King of Highhills obsessed with a giant Flea, these tales are inspired by the fairytales by Giambattista Basile.'),
(912, 912, 'I Am the Pretty Thing That Lives in the House', 'Thriller', 'A young nurse takes care of elderly author who lives in a haunted house.'),
(913, 913, 'Bridge to Terabithia', 'Adventure,Drama,Family', 'A preteen\'s life turns upside down when he befriends the new girl in school and they imagine a whole new fantasy world to escape reality.'),
(914, 914, 'Coherence', 'Mystery,Sci-Fi,Thriller', 'Strange things begin to happen when a group of friends gather for a dinner party on an evening when a comet is passing overhead.');
INSERT INTO `movie` (`movie_id`, `Rank`, `Title`, `Genre`, `Description`) VALUES
(915, 915, 'Notorious', 'Biography,Crime,Drama', 'The life and death story of Notorious B.I.G. (a.k.a. Christopher Wallace), who came straight out of Brooklyn to take the world of rap music by storm.'),
(916, 916, 'Goksung', 'Drama,Fantasy,Horror', 'A stranger arrives in a little village and soon after a mysterious sickness starts spreading. A policeman is drawn into the incident and is forced to solve the mystery in order to save his daughter.'),
(917, 917, 'The Expendables 2', 'Action,Adventure,Thriller', 'Mr. Church reunites the Expendables for what should be an easy paycheck, but when one of their men is murdered on the job, their quest for revenge puts them deep in enemy territory and up against an unexpected threat.'),
(918, 918, 'The Girl Next Door', 'Crime,Drama,Horror', 'Based on the Jack Ketchum novel of the same name, The Girl Next Door follows the unspeakable torture and abuses committed on a teenage girl in the care of her aunt...and the boys who witness and fail to report the crime.'),
(919, 919, 'Perfume: The Story of a Murderer', 'Crime,Drama,Fantasy', 'Jean-Baptiste Grenouille, born with a superior olfactory sense, creates the world\'s finest perfume. His work, however, takes a dark turn as he searches for the ultimate scent.'),
(920, 920, 'The Golden Compass', 'Adventure,Family,Fantasy', 'In a parallel universe, young Lyra Belacqua journeys to the far North to save her best friend and other kidnapped children from terrible experiments by a mysterious organization.'),
(921, 921, 'Centurion', 'Action,Adventure,Drama', 'A splinter group of Roman soldiers fight for their lives behind enemy lines after their legion is decimated in a devastating guerrilla attack.'),
(922, 922, 'Scouts Guide to the Zombie Apocalypse', 'Action,Comedy,Horror', 'Three scouts, on the eve of their last camp-out, discover the true meaning of friendship when they attempt to save their town from a zombie outbreak.'),
(923, 923, '17 Again', 'Comedy,Drama,Family', 'Mike O\'Donnell is ungrateful for how his life turned out. He gets a chance to rewrite his life when he tried to save a janitor near a bridge and jumped after him into a time vortex.'),
(924, 924, 'No Escape', 'Action,Thriller', 'In their new overseas home, an American family soon finds themselves caught in the middle of a coup, and they frantically look for a safe escape from an environment where foreigners are being immediately executed.'),
(925, 925, 'Superman Returns', 'Action,Adventure,Sci-Fi', 'Superman reappears after a long absence, but is challenged by an old foe who uses Kryptonian technology for world domination.'),
(926, 926, 'The Twilight Saga: Breaking Dawn - Part 1', 'Adventure,Drama,Fantasy', 'The Quileutes close in on expecting parents Edward and Bella, whose unborn child poses a threat to the Wolf Pack and the towns people of Forks.'),
(927, 927, 'Precious', 'Drama', 'In New York City\'s Harlem circa 1987, an overweight, abused, illiterate teen who is pregnant with her second child is invited to enroll in an alternative school in hopes that her life can head in a new direction.'),
(928, 928, 'The Sea of Trees', 'Drama', 'A suicidal American befriends a Japanese man lost in a forest near Mt. Fuji and the two search for a way out.'),
(929, 929, 'Good Kids', 'Comedy', 'Four high school students look to redefine themselves after graduation.'),
(930, 930, 'The Master', 'Drama', 'A Naval veteran arrives home from war unsettled and uncertain of his future - until he is tantalized by The Cause and its charismatic leader.'),
(931, 931, 'Footloose', 'Comedy,Drama,Music', 'City teenager Ren MacCormack moves to a small town where rock music and dancing have been banned, and his rebellious spirit shakes up the populace.'),
(932, 932, 'If I Stay', 'Drama,Fantasy,Music', 'Life changes in an instant for young Mia Hall after a car accident puts her in a coma. During an out-of-body experience, she must decide whether to wake up and live a life far different than she had imagined. The choice is hers if she can go on.'),
(933, 933, 'The Ticket', 'Drama', 'A blind man who regains his vision finds himself becoming metaphorically blinded by his obsession for the superficial.'),
(934, 934, 'Detour', 'Thriller', 'A young law student blindly enters into a pact with a man who offers to kill his stepfather, whom he feels is responsible for the accident that sent his mother into a coma.'),
(935, 935, 'The Love Witch', 'Comedy,Horror', 'A modern-day witch uses spells and magic to get men to fall in love with her.'),
(936, 936, 'Talladega Nights: The Ballad of Ricky Bobby', 'Action,Comedy,Sport', '#1 NASCAR driver Ricky Bobby stays atop the heap thanks to a pact with his best friend and teammate, Cal Naughton, Jr. But when a French Formula One driver, makes his way up the ladder, Ricky Bobby\'s talent and devotion are put to the test.'),
(937, 937, 'The Human Centipede (First Sequence)', 'Horror', 'A mad scientist kidnaps and mutilates a trio of tourists in order to reassemble them into a human centipede, created by stitching their mouths to each others\' rectums.'),
(938, 938, 'Super', 'Comedy,Drama', 'After his wife falls under the influence of a drug dealer, an everyday guy transforms himself into Crimson Bolt, a superhero with the best intentions, but lacking in heroic skills.'),
(939, 939, 'The Siege of Jadotville', 'Action,Drama,Thriller', 'Irish Commandant Pat Quinlan leads a stand off with troops against French and Belgian Mercenaries in the Congo during the early 1960s.'),
(940, 940, 'Up in the Air', 'Drama,Romance', 'Ryan Bingham enjoys living out of a suitcase for his job traveling around the country firing people, but finds that lifestyle threatened by the presence of a potential love interest and a new hire.'),
(941, 941, 'The Midnight Meat Train', 'Horror,Mystery', 'A photographer\'s obsessive pursuit of dark subject matter leads him into the path of a serial killer who stalks late night commuters, ultimately butchering them in the most gruesome ways imaginable.'),
(942, 942, 'The Twilight Saga: Eclipse', 'Adventure,Drama,Fantasy', 'As a string of mysterious killings grips Seattle, Bella, whose high school graduation is fast approaching, is forced to choose between her love for vampire Edward and her friendship with werewolf Jacob.'),
(943, 943, 'Transpecos', 'Thriller', 'For three Border Patrol agents working a remote desert checkpoint, the contents of one car will reveal an insidious plot within their own ranks. The next 24 hours will take them on a treacherous journey that could cost them their lives.'),
(944, 944, 'What\'s Your Number?', 'Comedy,Romance', 'A woman looks back at the past nineteen men she\'s had relationships with in her life and wonders if one of them might be her one true love.'),
(945, 945, 'Riddick', 'Action,Sci-Fi,Thriller', 'Left for dead on a sun-scorched planet, Riddick finds himself up against an alien race of predators. Activating an emergency beacon alerts two ships: one carrying a new breed of mercenary, the other captained by a man from Riddick\'s past.'),
(946, 946, 'Triangle', 'Fantasy,Mystery,Thriller', 'The story revolves around the passengers of a yachting trip in the Atlantic Ocean who, when struck by mysterious weather conditions, jump to another ship only to experience greater havoc on the open seas.'),
(947, 947, 'The Butler', 'Biography,Drama', 'As Cecil Gaines serves eight presidents during his tenure as a butler at the White House, the civil rights movement, Vietnam, and other major events affect this man\'s life, family, and American society.'),
(948, 948, 'King Cobra', 'Crime,Drama', 'This ripped-from-the-headlines drama covers the early rise of gay porn headliner Sean Paul Lockhart a.k.a. Brent Corrigan, before his falling out with the producer who made him famous. When... See full summary ?'),
(949, 949, 'After Earth', 'Action,Adventure,Sci-Fi', 'A crash landing leaves Kitai Raige and his father Cypher stranded on Earth, a millennium after events forced humanity\'s escape. With Cypher injured, Kitai must embark on a perilous journey to signal for help.'),
(950, 950, 'Kicks', 'Adventure', 'Brandon is a 15 year old whose dream is a pair of fresh Air Jordans. Soon after he gets his hands on them, they\'re stolen by a local hood, causing Brandon and his two friends to go on a dangerous mission through Oakland to retrieve them.'),
(951, 951, 'Me and Earl and the Dying Girl', 'Comedy,Drama', 'High schooler Greg, who spends most of his time making parodies of classic movies with his co-worker Earl, finds his outlook forever altered after befriending a classmate who has just been diagnosed with cancer.'),
(952, 952, 'The Descendants', 'Comedy,Drama', 'A land baron tries to reconnect with his two daughters after his wife is seriously injured in a boating accident.'),
(953, 953, 'Sex and the City 2', 'Comedy,Drama,Romance', 'While wrestling with the pressures of life, love, and work in Manhattan, Carrie, Miranda, and Charlotte join Samantha for a trip to Abu Dhabi (United Arab Emirates), where Samantha\'s ex is filming a new movie.'),
(954, 954, 'The Kings of Summer', 'Adventure,Comedy,Drama', 'Three teenage friends, in the ultimate act of independence, decide to spend their summer building a house in the woods and living off the land.'),
(955, 955, 'Death Race', 'Action,Sci-Fi,Thriller', 'Ex-con Jensen Ames is forced by the warden of a notorious prison to compete in our post-industrial world\'s most popular sport: a car race in which inmates must brutalize and kill one another on the road to victory.'),
(956, 956, 'That Awkward Moment', 'Comedy,Romance', 'Three best friends find themselves where we\'ve all been - at that confusing moment in every dating relationship when you have to decide \"So...where is this going?\"'),
(957, 957, 'Legion', 'Action,Fantasy,Horror', 'When a group of strangers at a dusty roadside diner come under attack by demonic forces, their only chance for survival lies with an archangel named Michael, who informs a pregnant waitress that her unborn child is humanity\'s last hope.'),
(958, 958, 'End of Watch', 'Crime,Drama,Thriller', 'Shot documentary-style, this film follows the daily grind of two young police officers in LA who are partners and friends, and what happens when they meet criminal forces greater than themselves.'),
(959, 959, '3 Days to Kill', 'Action,Drama,Thriller', 'A dying CIA agent trying to reconnect with his estranged daughter is offered an experimental drug that could save his life in exchange for one last assignment.'),
(960, 960, 'Lucky Number Slevin', 'Crime,Drama,Mystery', 'A case of mistaken identity lands Slevin into the middle of a war being plotted by two of the city\'s most rival crime bosses: The Rabbi and The Boss. Slevin is under constant surveillance by relentless Detective Brikowski as well as the infamous assassin Goodkat and finds himself having to hatch his own ingenious plot to get them before they get him.'),
(961, 961, 'Trance', 'Crime,Drama,Mystery', 'An art auctioneer who has become mixed up with a group of criminals partners with a hypnotherapist in order to recover a lost painting.'),
(962, 962, 'Into the Forest', 'Drama,Sci-Fi,Thriller', 'After a massive power outage, two sisters learn to survive on their own in their isolated woodland home.'),
(963, 963, 'The Other Boleyn Girl', 'Biography,Drama,History', 'Two sisters contend for the affection of King Henry VIII.'),
(964, 964, 'I Spit on Your Grave', 'Crime,Horror,Thriller', 'A writer who is brutalized during her cabin retreat seeks revenge on her attackers, who left her for dead.'),
(965, 965, 'Custody', 'Drama', 'The lives of three women are unexpectedly changed when they cross paths at a New York Family Court.'),
(966, 966, 'Inland Empire', 'Drama,Mystery,Thriller', 'As an actress starts to adopt the persona of her character in a film, her world starts to become nightmarish and surreal.'),
(967, 967, 'L\'odysse', 'Adventure,Biography', 'Highly influential and a fearlessly ambitious pioneer, innovator, filmmaker, researcher and conservationist, Jacques-Yves Cousteau\'s aquatic adventure covers roughly thirty years of an inarguably rich in achievements life.'),
(968, 968, 'The Walk', 'Adventure,Biography,Crime', 'In 1974, high-wire artist Philippe Petit recruits a team of people to help him realize his dream: to walk the immense void between the World Trade Center towers.'),
(969, 969, 'Wrecker', 'Action,Horror,Thriller', 'Best friends Emily and Lesley go on a road trip to the desert. When Emily decides to get off the highway and take a \"short cut,\" they become the target of a relentless and psychotic trucker... See full summary ?'),
(970, 970, 'The Lone Ranger', 'Action,Adventure,Western', 'Native American warrior Tonto recounts the untold tales that transformed John Reid, a man of the law, into a legend of justice.'),
(971, 971, 'Texas Chainsaw 3D', 'Horror,Thriller', 'A young woman travels to Texas to collect an inheritance; little does she know that an encounter with a chainsaw-wielding killer is part of the reward.'),
(972, 972, 'Disturbia', 'Drama,Mystery,Thriller', 'A teen living under house arrest becomes convinced his neighbor is a serial killer.'),
(973, 973, 'Rock of Ages', 'Comedy,Drama,Musical', 'A small town girl and a city boy meet on the Sunset Strip, while pursuing their Hollywood dreams.'),
(974, 974, 'Scream 4', 'Horror,Mystery', 'Ten years have passed, and Sidney Prescott, who has put herself back together thanks in part to her writing, is visited by the Ghostface Killer.'),
(975, 975, 'Queen of Katwe', 'Biography,Drama,Sport', 'A Ugandan girl sees her world rapidly change after being introduced to the game of chess.'),
(976, 976, 'My Big Fat Greek Wedding 2', 'Comedy,Family,Romance', 'A Portokalos family secret brings the beloved characters back together for an even bigger and Greeker wedding.'),
(977, 977, 'Dark Places', 'Drama,Mystery,Thriller', 'Libby Day was only eight years old when her family was brutally murdered in their rural Kansas farmhouse. Almost thirty years later, she reluctantly agrees to revisit the crime and uncovers the wrenching truths that led up to that tragic night.'),
(978, 978, 'Amateur Night', 'Comedy', 'Guy Carter is an award-winning graduate student of architecture. He\'s got a beautiful wife and a baby on the way. The problem? He doesn\'t have \"his ducks in a row,\" which only fuels his ... See full summary ?'),
(979, 979, 'It\'s Only the End of the World', 'Drama', 'Louis (Gaspard Ulliel), a terminally ill writer, returns home after a long absence to tell his family that he is dying.'),
(980, 980, 'The Skin I Live In', 'Drama,Thriller', 'A brilliant plastic surgeon, haunted by past tragedies, creates a type of synthetic skin that withstands any kind of damage. His guinea pig: a mysterious and volatile woman who holds the key to his obsession.'),
(981, 981, 'Miracles from Heaven', 'Biography,Drama,Family', 'A young girl suffering from a rare digestive disorder finds herself miraculously cured after surviving a terrible accident.'),
(982, 982, 'Annie', 'Comedy,Drama,Family', 'A foster kid, who lives with her mean foster mom, sees her life change when business tycoon and New York mayoral candidate Will Stacks makes a thinly-veiled campaign move and takes her in.'),
(983, 983, 'Across the Universe', 'Drama,Fantasy,Musical', 'The music of the Beatles and the Vietnam War form the backdrop for the romance between an upper-class American girl and a poor Liverpudlian artist.'),
(984, 984, 'Let\'s Be Cops', 'Comedy', 'Two struggling pals dress as police officers for a costume party and become neighborhood sensations. But when these newly-minted \"heroes\" get tangled in a real life web of mobsters and dirty detectives, they must put their fake badges on the line.'),
(985, 985, 'Max', 'Adventure,Family', 'A Malinois dog that helped American Marines in Afghanistan returns to the United States and is adopted by his handler\'s family after suffering a traumatic experience.'),
(986, 986, 'Your Highness', 'Adventure,Comedy,Fantasy', 'When Prince Fabious\'s bride is kidnapped, he goes on a quest to rescue her... accompanied by his lazy useless brother Thadeous.'),
(987, 987, 'Final Destination 5', 'Horror,Thriller', 'Survivors of a suspension-bridge collapse learn there\'s no way you can cheat Death.'),
(988, 988, 'Endless Love', 'Drama,Romance', 'The story of a privileged girl and a charismatic boy whose instant desire sparks a love affair made only more reckless by parents trying to keep them apart.'),
(989, 989, 'Martyrs', 'Horror', 'A young woman\'s quest for revenge against the people who kidnapped and tormented her as a child leads her and a friend, who is also a victim of child abuse, on a terrifying journey into a living hell of depravity.'),
(990, 990, 'Selma', 'Biography,Drama,History', 'A chronicle of Martin Luther King\'s campaign to secure equal voting rights via an epic march from Selma to Montgomery, Alabama in 1965.'),
(991, 991, 'Underworld: Rise of the Lycans', 'Action,Adventure,Fantasy', 'An origins story centered on the centuries-old feud between the race of aristocratic vampires and their onetime slaves, the Lycans.'),
(992, 992, 'Taare Zameen Par', 'Drama,Family,Music', 'An eight-year-old boy is thought to be a lazy trouble-maker, until the new art teacher has the patience and compassion to discover the real problem behind his struggles in school.'),
(993, 993, 'Take Me Home Tonight', 'Comedy,Drama,Romance', 'Four years after graduation, an awkward high school genius uses his sister\'s boyfriend\'s Labor Day party as the perfect opportunity to make his move on his high school crush.'),
(994, 994, 'Resident Evil: Afterlife', 'Action,Adventure,Horror', 'While still out to destroy the evil Umbrella Corporation, Alice joins a group of survivors living in a prison surrounded by the infected who also want to relocate to the mysterious but supposedly unharmed safe haven known only as Arcadia.'),
(995, 995, 'Project X', 'Comedy', '3 high school seniors throw a birthday party to make a name for themselves. As the night progresses, things spiral out of control as word of the party spreads.'),
(996, 996, 'Secret in Their Eyes', 'Crime,Drama,Mystery', 'A tight-knit team of rising investigators, along with their supervisor, is suddenly torn apart when they discover that one of their own teenage daughters has been brutally murdered.'),
(997, 997, 'Hostel: Part II', 'Horror', 'Three American college students studying abroad are lured to a Slovakian hostel, and discover the grim reality behind it.'),
(998, 998, 'Step Up 2: The Streets', 'Drama,Music,Romance', 'Romantic sparks occur between two dance students from different backgrounds at the Maryland School of the Arts.'),
(999, 999, 'Search Party', 'Adventure,Comedy', 'A pair of friends embark on a mission to reunite their pal with the woman he was going to marry.'),
(1000, 1000, 'Nine Lives', 'Comedy,Family,Fantasy', 'A stuffy businessman finds himself trapped inside the body of his family\'s cat.');
